t.exports='---changelog---\ndate: "2022-11-01"\nlocale: "en-US"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\nNew Features {added marginTop}\n======================\n\n* **Activities joined the party.** Hop into any voice channel and instantly launch (because, rocket ship—you get it) a Watch Together playlist or Putt Party game for a cozy hangout. Got Nitro? You get the full Activities catalog and the heavy burden of flexing on your friends. The [blog](https://discord.com/blog/server-activities-games-voice-watch-together) has the full story. \n* **Introducing Nitro Basic.** Our littlest version of Nitro, for an even littler price. Unlock all emoji everywhere, upload bigger files, and more. Now in most countries, more soon.\n* **New Nitro perk: Profile Themes.** Choose a color scheme to accent your profile. Available soon in User Settings to all whomst have Nitro.\n* **Hear ye, hear ye, Forum Channels are here…yee.** Our take on a classic. Free yourself from the shackles of a single topic, for you contain multitudes and too many thoughts.\n* **Add apps to your server right from the new [App Directory](https://discord.com/blog/app-directory-is-here-mods-and-admins).** The Discord Developer community builds awesome things that make your server work for you. And we were like…shouldn’t it be easier to find them? So now it is. If you manage a server, go to Server Settings to check it out.\n* **Discord Voice on Xbox is now here for everyone.** YES, I’M BEING SERIOUS. Friends can see what game you’re playing on your console and YOU CAN NOW TALK IN DISCORD VOICE FROM YOUR XBOX JUST LIKE YOU’VE REQUESTED FOR YEARS. THANK YOU FOR YOUR PATIENCE. Learn more on the [blog](https://dis.gd/xbox-voice). \n\nSettings Updates {progress}\n======================\n\n* **Random messages are now filtered.** If someone you’re not friends with sends you a DM, you may see it in a separate Message Requests folder. If you don’t mind messages from anyone, you can [turn it off](https://support.discord.com/hc/articles/7924992471191-Message-Requests).\n* **You can manage your Highlight notifications.** Keep up with what’s going on in your favorite servers—or [don’t](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications), if you don’t like that. You do you.\n* **Beefed up spam detection in Community servers.** If someone tries to spam @mentions or post a scam link, AutoMod can block the message from being posted. Community admins can manage this in Server Settings.\n* **View devices where you‘re logged in.** Check out User Settings › Devices, a wonderful place where you can log out of the family computer or a million-year-old phone.\n\n\n---changelog---\ndate: "2022-11-01"\nlocale: "bg-bg"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\nНови функции {added marginTop}\n======================\n\n* **„Дейности“ са вече тук.** Влез в който и да е гласов канал и веднага можеш да изстреляш (все едно си на космически кораб) някой плейлист в Watch Together или игра Putt Party, за да си прекарате приятно. Имаш Nitro? Значи ще получиш целия каталог с „Дейности“ и тежката задача да се изфукаш пред приятелите си. [В блога](https://discord.com/blog/server-activities-games-voice-watch-together) можеш да прочетеш всички подробности. \n* **Представяме Nitro Basic.** Нашата най-мини версия на Nitro, но за още по-мини цена. Отключваш всички емоджита навсякъде, качваш по-големи файлове и още много други. Вече е достъпно в повечето страни, а в останалите – скоро.\n* **Нов бонус в Nitro: профилни теми.** Избери цветова схема, която да акцентира профила ти. Скоро тази опция ще е налична в „Потребителски настройки“ за всички, които имат Nitro.\n* **Насам, насам, народе! Форумните канали са вече тук, ура!** Нашия прочит на една класика. Освободи се от оковите на единичните теми, защото в себе си всеки таи какви ли не мисли.\n* **Добави приложения към сървъра си директно от [App Directory](https://discord.com/blog/app-directory-is-here-mods-and-admins).** Общността от разработчици на Discord прави страхотни неща, които карат сървъра ти да работи за теб. И по едно време си помислихме: „Всъщност не трябва ли такива неща да могат да се намират по-лесно?“. И ето ги. Ако управляваш сървър, отиди на „Настройки на сървъра“, за да видиш за какво става дума.\n* **Discord Voice за Xbox вече е тук и е достъпен за всички.** ДА, СЕРИОЗНО! Приятелите ти могат да видят какви игри играеш в конзолата си и ВЕЧЕ МОЖЕШ ДА ГОВОРИШ В DISCORD VOICE ОТ XBOX-A СИ, ТОЧНО КАКТО ИСКАШЕ ОТ ГОДИНИ НАСАМ. БЛАГОДАРИМ ТИ ЗА ТЪРПЕНИЕТО. Научи повече в [блога](https://dis.gd/xbox-voice). \n\nАктуализации по настройките {progress}\n======================\n\n* **Случайните съобщения вече се филтрират.** Ако някой, който не е сред приятелите ти, ти изпрати директно съобщение, можеш да го видиш в отделна папка „Заявки за съобщения“. Ако нямаш против да получаваш съобщения от всякакви хора, можеш да [изключиш тази опция](https://support.discord.com/hc/articles/7924992471191-Message-Requests).\n* **Можеш да управляваш известията си за акценти.** Бъди в течение на това, което се случва в любимите ти сървъри – [или пък не](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications), ако не искаш. Ти си решаваш.\n* **Още по-безотказно засичане на спам в сървърите на общността.** Ако някой се опитва да спами с @mentions или да публикува връзка с цел измама, AutoMod може да блокира съобщението и то да не се публикува. Администраторите на общността могат да управляват това от настройките на сървъра.\n* **Преглед на устройствата, в които сте логнати.** Провери в „Потребителски настройки > Устройства“ – чудесно място, където можеш да се спасиш от семейния компютър или от стария телефон на сто милиона години.\n\n\n---changelog---\ndate: "2022-11-01"\nlocale: "cs-cz"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\nNové funkce {added marginTop}\n======================\n\n* **Aktivity dorazily na party.** Naskoč do libovolného hlasového kanálu a rychlostí blesku začni přehrávat seznam skladeb Watch Together nebo nahoď hru Putt Party a bav se ještě líp než kdy předtím. Máš Nitro? Pak si můžeš vybrat z kompletního katalogu aktivit a pochlubit se některou z nich svým přátelům. Podrobné informace najdeš [na blogu](https://discord.com/blog/server-activities-games-voice-watch-together). \n* **Představujeme Nitro Basic.** Tohle je naše nejmenší verze Nitra za ještě menší cenu. Odemkni všechny smajlíky na všech serverech, nahrávej větší soubory a užij si řadu dalších výhod. Tuto nabídku aktuálně můžeš využít ve většině zemí a další budou brzy následovat.\n* **Nové vylepšení Nitra: Motivy profilu.** Vyber si barevný motiv, kterým oživíš svůj profil. Pokud máš Nitro, pak co nevidět tuto možnost uvidíš v části Uživatelská nastavení.\n* **Slyšte, slyšte… Kanály pro fóra jsou tady!** Nehynoucí klasika v našem podání. Máš plnou hlavu nápadů? Pak se nenech svazovat omezením jediného tématu, a dej svým myšlenkám volný průchod.\n* **Naplň svůj server aplikacemi přímo z nového [App Directory](https://discord.com/blog/app-directory-is-here-mods-and-admins).** Komunita vývojářů na Discordu vyváří skvělé věci, díky kterým tvůj server funguje jako švýcarské hodinky. Napadlo nás, že by bylo dobré mít k těmto věcem snazší přístup. A tak jsme to prostě zařídili. Jestli si chceš usnadnit správu svého serveru, mrkni do Nastavení serveru.\n* **Discord Voice na Xboxu je tu nyní pro všechny.** ANO, MYSLÍM TO VÁŽNĚ. Přátelé uvidí, jakou hru právě hraješ na své nabušené konzoli, a TY SI BUDEŠ MOCT POVÍDAT PROSTŘEDNICTVÍM HLASOVÝCH SLUŽEB DISCORDU ZE SVÉHO XBOXU TAK, JAK O TOM UŽ CELÉ ROKY TOUŽÍŠ. DĚKUJEME ZA TRPĚLIVOST. Další informace se dozvíš [na blogu](https://dis.gd/xbox-voice). \n\nAktualizace nastavení {progress}\n======================\n\n* **Náhodné zprávy se odteď filtrují.** Když ti někdo nezařazený na seznam tvých přátel pošle PZ, uvidíš ji v samostatné složce Žádosti o zprávy. Jestli ti náhodné zprávy od kohokoli nevadí, můžeš filtrování [vypnout](https://support.discord.com/hc/articles/7924992471191-Message-Requests).\n* **Spravuj oznámení týkající se doporučeného obsahu.** Měj přehled o tom, co se děje na tvých oblíbených serverech – anebo [neměj](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications), pokud o to nemáš zájem. Je to jenom na tobě.\n* **Nelítostná detekce spamu na komunitních serverech.** Když se někdo pokusí spamovat @zmínkami nebo zveřejnit podvodný odkaz, funkce AutoMod může takovou zprávu zablokovat. Správci komunity mohou toto nastavení spravovat v části Nastavení serveru.\n* **Sleduj, na kterých zařízeních je aktivní tvoje přihlášení.** Přejdi do části Uživatelská nastavení › Zařízení. Sice ti neukáže, kdo je v zemi zdejší nejhezčí a nejkrásnější, ale můžeš se tady z libovolného zařízení odhlásit – ať už je to tvůj výkonný rodinný počítač nebo prehistorický telefon.\n\n\n---changelog---\ndate: "2022-11-01"\nlocale: "da-da"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\nNye funktioner {added marginTop}\n======================\n\n* **Aktiviteter er klar til affyring.** Når du åbner en talekanal, kan du nu straks starte en Watch Together-playliste eller et Putt Party-spil og hænge ud sammen og hygge. Har du Nitro? Så får du hele kataloget af Aktiviteter og den tunge byrde at give dine venner en god oplevelse! [Bloggen](https://discord.com/blog/server-activities-games-voice-watch-together) har den fulde historie. \n* **Vi lancerer nu Nitro Basic.** Vores mindste version af Nitro til en endnu mindre pris. Lås op for alle emoji overalt, upload større filer og meget mere. Fås nu i de fleste lande, og flere kommer løbende til.\n* **Nyt Nitro-frynsegode: Profiltemaer.** Vælg et farveskema for at fremhæve din profil. Snart tilgængelig under Brugerindstillinger for alle, der har Nitro.\n* **Forumkanaler er nu landet.** Vores bud på en klassiker. Befri dig selv fra de bånd, som et enkelt emne giver, for du er et komplekst menneske og har tanker om alt mellem himmel og jord.\n* **Føj apps til din server direkte fra det nye [App Directory](https://discord.com/blog/app-directory-is-here-mods-and-admins).** Vores community af Discord-udviklere bygger fantastiske ting, der får din server til at arbejde for dig. Og vi tænkte, at det burde være nemmere at finde alt det. Så det er det nu. Hvis du administrerer en server, kan du gå til Serverindstillinger for se det hele.\n* **Discord Voice på Xbox er nu tilgængelig for alle.** JA, DET ER FAKTISK SANDT. Venner kan se, hvilket spil du spiller på din konsol, og DU KAN NU BRUGE DISCORD VOICE FRA DIN XBOX TIL AT TALE MED DEM, PRÆCIS SOM I HAR EFTERSPURGT I ÅREVIS. TAK FOR JERES TÅLMODIGHED. Få mere at vide på [bloggen](https://dis.gd/xbox-voice). \n\nOpdateringer af indstillinger {progress}\n======================\n\n* **Tilfældige beskeder filtreres nu.** Hvis en person, du ikke er venner med, sender dig en direkte besked, kan du se den i en separat mappe til beskedanmodninger. Hvis du ikke har noget imod at kunne modtage beskeder fra hvem som helst, kan du [slå det fra](https://support.discord.com/hc/articles/7924992471191-Message-Requests).\n* **Du kan administrere dine fremhævelser af meddelelser.** Følg med i, hvad der sker på dine yndlingsservere – eller [lad være](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications), hvis du ikke bryder dig om det. Det afgør du selv.\n* **Der er indført en bedre registrering af spam på community-servere.** Hvis nogen forsøger at spamme @mentions eller lave et opslag, der linker til svindel, kan AutoMod forhindre, at beskeden sendes. Community-administratorer kan håndtere funktionen under serverindstillinger.\n* **Vis enheder, hvor du er logget ind.** Gå til Brugerindstillinger › Enheder for at opleve et vidunderligt sted, hvor du kan logge af familiens computer eller en oldnordisk telefon.\n\n\n---changelog---\ndate: "2022-11-01"\nlocale: "nl"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\nNieuwe functies {added marginTop}\n======================\n\n* **Check onze nieuwste aanwinst: Activiteiten.** Duik in een willekeurig spraakkanaal en lanceer direct (want raket, jeweetwel) een Watch Together-afspeellijst of een potje Putt Party om de sfeer te verhogen. Heb je Nitro? Dan ontvang je de complete Activiteitencatalogus en de zware last om je vrienden ermee de ogen uit te steken. In de [blog](https://discord.com/blog/server-activities-games-voice-watch-together) vind je alle informatie. \n* **We presenteren Nitro Basic.** Onze kleinste versie van Nitro, voor een nog kleinere prijs. Ontgrendel alle emoji overal, upload grotere bestanden en maak gebruik van nog meer opties. Nu verkrijgbaar in de meeste landen. Binnenkort meer info.\n* **Nieuw Nitro-voordeel: profielthema\'s.** Kies een kleurenschema om je profiel te accentueren. Binnenkort beschikbaar in de gebruikersinstellingen voor alle Nitro-abonnees.\n* **Hoort, zegt het voort. Forumkanalen zijn nu aan boord.** Onze kijk op een klassieker. Bevrijd jezelf van de ketenen van één enkel onderwerp en laat je talloze complexe gedachten de vrije loop.\n* **Voeg apps toe aan je server, direct uit de [App Directory](https://discord.com/blog/app-directory-is-here-mods-and-admins).** De Discord-ontwikkelaarscommunity bouwt toffe dingen om je server voor je aan het werk te zetten. Toen dachten wij: zouden ze niet wat makkelijker te vinden moeten zijn? En dat is nu geregeld. Als je een server beheert, ga dan naar Serverinstellingen om te kijken wat er nieuw is.\n* **Discord-spraakchat voor Xbox is nu voor iedereen beschikbaar.** JA, SERIEUS. Vrienden kunnen zien welke game je op je console speelt en JE KUNT NU DISCORD-SPRAAKCHAT GEBRUIKEN OP JE XBOX, ZOALS JULLIE AL JAREN HEBBEN GEVRAAGD. BEDANKT VOOR JULLIE GEDULD. Meer informatie vind je in de [blog](https://dis.gd/xbox-voice). \n\nInstellingenupdates {progress}\n======================\n\n* **Willekeurige berichten worden nu gefilterd.** Als iemand waar je geen vrienden mee bent je een privébericht stuurt, verschijnt dat in de aparte map Berichtenverzoeken. Als je het niet erg vindt om van iedereen berichten te kunnen ontvangen, kun je dit [uitschakelen](https://support.discord.com/hc/articles/7924992471191-Message-Requests).\n* **Je kunt Hoogtepuntmeldingen beheren.** Blijf op de hoogte wat er gebeurt op je favoriete server, of [niet](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications), als je dat liever hebt. Jij bent je eigen baas.\n* **Betere spamdetectie op communityservers.** Als iemand @mentions probeert te spammen of een verdachte link probeert te posten, kan AutoMod het bericht blokkeren zodat dat niet gebeurt. Communitybeheerders kunnen dit regelen in de Serverinstellingen.\n* **Bekijk apparaten waarop je bent ingelogd.** Check Gebruikersinstellingen › Apparaten. Op deze heerlijke plek kun je uitloggen op de gezinscomputer of op een superoude telefoon.\n\n\n---changelog---\ndate: "2022-11-01"\nlocale: "en-gb"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\nNew Features {added marginTop}\n======================\n\n* **Activities joined the party.** Hop into any voice channel and instantly launch (because, rocket ship — get it?) a Watch Together playlist or Putt Party game for a cosy hangout. Got Nitro? You get the full Activities catalogue and the heavy burden of flexing on your friends. The [blog](https://discord.com/blog/server-activities-games-voice-watch-together) has the full story. \n* **Introducing Nitro Basic.** Our littlest version of Nitro, for an even littler price. Unlock all emoji everywhere, upload bigger files, and more. Now in most countries, more coming soon.\n* **New Nitro perk: Profile themes.** Choose a colour scheme to accent your profile. Available soon in User settings to all whomst have Nitro.\n* **Hear ye, hear ye, Forum channels are here…yee.** Our take on a classic. Free yourself from the shackles of a single topic, for you contain multitudes and too many thoughts.\n* **Add apps to your server right from the new [App Directory](https://discord.com/blog/app-directory-is-here-mods-and-admins).** The Discord developer community builds awesome things that make your server work for you. And we were like…shouldn’t it be easier to find them? So now it is. If you manage a server, go to Server settings to check it out.\n* **Discord Voice on Xbox is now here for everyone.** YES, I’M SERIOUS. Friends can see what game you’re playing on your console and YOU CAN NOW TALK IN DISCORD VOICE FROM YOUR XBOX JUST LIKE YOU’VE BEEN REQUESTING FOR YEARS. THANK YOU FOR YOUR PATIENCE. Learn more on the [blog](https://dis.gd/xbox-voice). \n\nSettings updates {progress}\n======================\n\n* **Random messages are now filtered.** If someone you’re not friends with sends you a DM, you may see it in a separate Message requests folder. If you don’t mind messages from anyone, you can [turn it off](https://support.discord.com/hc/articles/7924992471191-Message-Requests).\n* **You can manage your Highlight notifications.** Keep up with what’s going on in your favourite servers—or [don’t](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications), if you prefer not to. You do you.\n* **Beefed up spam detection in Community servers.** If someone tries to spam @mentions or post a scam link, AutoMod can block the message from being posted. Community admins can manage this in Server settings.\n* **View devices where you’re logged in.** Check out User settings › Devices, a wonderful place where you can log out of the family computer or a million-year-old phone.\n\n\n---changelog---\ndate: "2022-11-01"\nlocale: "fi-fi"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\nUudet ominaisuudet {added marginTop}\n======================\n\n* **Toiminnot ottaa kierroksia.** Singahda mille tahansa puhekanavalle, laukaise saman tien liikkeelle Watch Together -toistolista tai Putt Party -peli (kuin raketti ikään) ja hengaile kaikessa rauhassa. Löytyykö Nitroa? Käytettävissäsi on koko Toiminnot-katalogi ja oi niin oiva sauma levennellä kavereille. Lue lisää [blogista](https://discord.com/blog/server-activities-games-voice-watch-together). \n* **Esittelyssä Nitro Basic.** Nitron kaikkein pikkuruisin versio, vielä pikkuriikkisempään hintaan. Avaa kaikki emojit käyttöön kaikkialla, lataa isompia tiedostoja palvelimelle ja paljon muuta. Nyt saatavana useimmissa maissa, lisää tulossa pian.\n* **Uusi Nitro-etu: profiiliteemat.** Valitse profiilia korostava väriteema. Pian kaikkien Nitron hankkineiden käytettävissä käyttäjäasetuksissa.\n* **Jee, jee, foorumikanavaa pukkaa… jee.** Oma versiomme klassikosta. Vapauta itsesi yksittäisen aiheen kahleista, sillä olethan monitahoinen itsekin ja ajatuksia täynnä.\n* **Lisää sovelluksia palvelimellesi suoraan uudesta [App Directorysta](https://discord.com/blog/app-directory-is-here-mods-and-admins).** Discordin kehittäjäyhteisö rakentaa upeita juttuja, joiden ansiosta palvelimesi palvelee sinua entistäkin paremmin. Ja me oltiin vähän niinku että… eikö niiden pitäisi olla helpompia löytää? Joten nyt ne ovat. Jos hallinnoit palvelinta, käy toteamassa asia palvelinasetuksista.\n* **Discordin puhekanavat Xboxilla ovat nyt kaikkien käytettävissä.** KYLLÄ, OLEN AIVAN TOSISSANI. Kaverit näkevät nyt, mitä peliä pelaat konsolillasi, ja VOITTE PUHUA DISCORDIN PUHEKANAVALLA XBOXILLA – JUURI NIIN KUIN ON VUOSIKAUDET TOIVOTTU. KIITOS KÄRSIVÄLLISYYDESTÄ. Lisätietoja saat [blogista](https://dis.gd/xbox-voice). \n\nAsetuksia koskevia päivityksiä {progress}\n======================\n\n* **Tästedes satunnaiset viestit suodatetaan.** Jos joku muu kuin kaveri lähettää sinulle yksityisviestin, se voi näkyä erillisessä viestipyyntöjen kansiossa. Jos otat mielelläsi vastaan viestejä keneltä hyvänsä, voit [poistaa asetuksen käytöstä](https://support.discord.com/hc/articles/7924992471191-Message-Requests).\n* **Voit hallita omia kohokohtailmoituksia.** Seuraa suosikkipalvelintesi meininkejä – tai [älä](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications) seuraa, jos ei satu miellyttämään. Tee ihan niin kuin lystäät.\n* **Entistä parempi roskapostin tunnistus yhteisöpalvelimilla.** Jos joku yrittää roskapostittaa @mainintoja tai julkaista roskalinkin, AutoMod voi estää vietin julkaisemisen. Yhteisön ylläpitäjät voivat hallita tätä palvelinasetuksissa.\n* **Katso, millä laitteilla olet kirjautuneena.** Käy vilkaisemassa Käyttäjäasetukset › Laitteet. Siellä voit kirjautua mainion kätevästi ulos perheen tietokoneelta tai tyyliin miljoona vuotta vanhasta puhelimesta.\n\n\n---changelog---\ndate: "2022-11-01"\nlocale: "fr"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\nNouvelles fonctionnalités {added marginTop}\n======================\n\n* **Les Activités entrent en scène !** Rends-toi dans un salon vocal et lance instantanément (comme une fusée) une playlist de vidéos à regarder ensemble avec Watch Together ou une manche de Putt Party pour passer un bon moment ensemble. Tu as Nitro ? Tu as donc accès à l\'ensemble des Activités et le lourd fardeau de rendre tous tes amis jaloux. Cet [article de blog](https://discord.com/blog/server-activities-games-voice-watch-together) te donnera tous les détails. \n* **Nitro Basic fait ses débuts.** Notre version mini de Nitro, à un prix toujours plus mini. Déverrouille tous les émojis partout, uploade des fichiers plus volumineux et bien plus encore. Disponible dans la majorité des pays, plus de détails bientôt.\n* **Nouvel avantage Nitro : les thèmes de profil.** Choisis un ensemble de couleurs pour mettre en valeur ton profil. Bientôt disponible dans les Paramètres utilisateur pour tous les abonnés Nitro.\n* **Oyez oyez, les salons forums sont là... Youpi !** Voici notre version de ce classique. Libère-toi des contraintes imposées par un seul sujet, tu es beaucoup trop complexe et tu as bien trop d\'idées pour ça.\n* **Ajoute des applications à ton serveur directement depuis le nouvel [App Directory](https://discord.com/blog/app-directory-is-here-mods-and-admins).** La communauté des Développeurs de Discord crée des options incroyables qui font travailler ton serveur à ta place. Et on s\'est dit que ce serait bien qu\'elles soient plus faciles à trouver. Alors voilà, c\'est fait. Si tu administres un serveur, rends-toi dans les paramètres du serveur pour y jeter un œil.\n* **Le chat Discord sur Xbox est maintenant disponible pour tout le monde.** OUI, VRAIMENT. Tes amis pourront voir le jeu auquel tu es en train de jouer sur ta console et TU POURRAS LES REJOINDRE EN CHAT DISCORD DEPUIS TA XBOX COMME ON NOUS LE DEMANDE DEPUIS SI LONGTEMPS. MERCI POUR TA PATIENCE. Lis cet [article](https://dis.gd/xbox-voice) pour en savoir plus. \n\nMises à jour des paramètres {progress}\n======================\n\n* **Les messages d\'inconnus sont maintenant filtrés.** Si un utilisateur qui ne fait pas partie de tes amis t\'envoie un MP, tu le verras dans un dossier séparé appelé Demandes de message. Si tu préfères continuer de recevoir les messages de tout le monde, tu peux [désactiver cette option](https://support.discord.com/hc/articles/7924992471191-Message-Requests).\n* **Tu peux gérer tes notifications de moments notables.** Suis ce qui se passe sur tes serveurs préférés... ou [pas](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications), si ça ne t\'intéresse pas. C\'est toi qui choisis.\n* **Renforce la détection de spam dans les serveurs de communauté.** Si quelqu\'un essaie de spammer des @mentions ou de poster un lien frauduleux, AutoMod peut empêcher le message d\'être posté. Les administrateurs de communauté peuvent gérer cette option dans les paramètres du serveur.\n* **Vérifie sur quels appareils tu es connecté(e).** Va dans Paramètres utilisateur > Appareils, l\'endroit idéal pour te déconnecter de l\'ordinateur familial ou d\'un portable d\'il y a dix mille ans.\n\n\n---changelog---\ndate: "2022-11-01"\nlocale: "de"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\nNeue Features {added marginTop}\n======================\n\n* **Es gibt jetzt Aktivitäten.** Tritt einem Sprachkanal bei und starte eine Watch-Together-Playlist oder ein Putt-Party-Spiel für ein abgespactes (weil wegen Raumschiff … du verstehst?) Miteinander. Und wenn du Nitro hast, bekommst du nicht nur den kompletten Aktivitäten-Katalog, sondern auch die schwere Bürde, damit vor deinen Freunden anzugeben. Alle weiteren Infos findest du auf dem [Blog](https://discord.com/blog/server-activities-games-voice-watch-together). \n* **Wir stellen vor: Nitro Basic.** Unsere kleinste Nitro-Version zum kleinsten Preis. Erhalte überall Zugriff auf alle Emojis, lade größere Dateien hoch und mehr. Jetzt in den meisten Ländern verfügbar, weitere werden bald folgen.\n* **Neuer Vorteil mit Nitro: Profilschemata.** Wähle ein Farbschema, um dein Profil hervorzuheben. Bald für alle Nitro-Abonnenten über die Benutzereinstellungen verfügbar.\n* **Hört, hört: Forenkanäle sind jetzt verfügbar.** Unsere Interpretation eines Klassikers. Löse dich von den Fesseln eines einzelnen Themas – dein mit Gedanken überschwemmter Kopf wird es dir danken.\n* **Füge Apps direkt über den neuen [App Directory](https://discord.com/blog/app-directory-is-here-mods-and-admins) zu deinem Server hinzu.** Die Discord-Entwickler-Community erschafft fantastische Dinge, mit denen du deinen Server an deine Wünsche anpassen kannst. Und wir dachten uns: „Sollten die nicht einfacher zu finden sein?“ Tja, jetzt sind sie es! Wenn du einen Server verwaltest, sieh dir die neue Funktion in den Servereinstellungen an.\n* **Discord-Sprachchat auf Xbox gibt es jetzt für alle.** KEIN SCHERZ! Deine Freunde können sehen, welches Spiel du auf deiner Konsole spielst, und jetzt WIRST DU ÜBER DEINE XBOX DEN DISCORD-SPRACHCHAT NUTZEN KÖNNEN, WIE VIELE ES SICH SEIT JAHREN GEWÜNSCHT HABEN. DANKE FÜR DEINE GEDULD! Mehr erfährst du in dem [Blog](https://dis.gd/xbox-voice). \n\nEinstellungsupdates {progress}\n======================\n\n* **Fremde Nachrichten werden jetzt gefiltert.** Wenn du eine Direktnachricht von einer Person erhältst, mit der du nicht befreundet bist, wird sie in einem separaten Nachrichtenanfragen-Ordner angezeigt. Wenn dir Nachrichten von Fremden nichts ausmachen, kannst du diese Option [deaktivieren](https://support.discord.com/hc/articles/7924992471191-Message-Requests).\n* **Du kannst deine Highlight-Benachrichtigungen verwalten.** Bleibe auf deinen Lieblingsservern immer auf dem neuesten Stand – oder auch [nicht](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications), wenn dir das lieber ist. Ganz wie du magst.\n* **Aufgemöbelte Spam-Erkennung auf Community-Servern.** Wenn jemand versucht, @Erwähnungen zu spammen oder einen betrügerischen Link postet, kann AutoMod das Senden der Nachricht verhindern. Community-Administratoren können diese Option in den Servereinstellungen verwalten.\n* **Sieh nach, auf welchen Geräten du angemeldet bist.** Wenn du dich vom Familien-PC oder einem Handy aus dem letzten Jahrhundert abmelden möchtest, dann schau einfach bei Benutzereinstellungen › Geräte vorbei.\n\n\n---changelog---\ndate: "2022-11-01"\nlocale: "el-gr"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\nΝέες λειτουργίες {added marginTop}\n======================\n\n* **Οι Δραστηριότητες κατέφτασαν.** Μπες σε ένα κανάλι ομιλίας και ξεκίνα άμεσα μια λίστα αναπαραγωγής Watch Together ή το παιχνίδι Putt Party και χαλαρώστε όλοι μαζί παρέα. Έχεις Nitro; Αποκτάς τον πλήρη κατάλογο Δραστηριοτήτων και το βάρος της επίδειξης στους φίλους σου. Στο [blog](https://discord.com/blog/server-activities-games-voice-watch-together) μπορείς να διαβάσεις όλες τις λεπτομέρειες. \n* **Παρουσιάζουμε το Nitro Basic.** Τη μικρότερη έκδοση του Nitro, για ακόμη μικρότερη τιμή. Ξεκλείδωσε όλα τα emoji παντού, μεταφόρτωσε μεγαλύτερα αρχεία και πολλά άλλα. Τώρα διαθέσιμο στις περισσότερες χώρες, σύντομα σε ακόμη περισσότερες.\n* **Νέο προνόμιο Nitro: Θέματα προφίλ.** Επίλεξε έναν συνδυασμό χρωμάτων για να τονίσεις το προφίλ σου. Σύντομα διαθέσιμο στις Ρυθμίσεις χρήστη σε όλους τους συνδρομητές Nitro.\n* **Ακούσατε, ακούσατε, τα Κανάλια φόρουμ είναι εδώ…Ναι!** Η δική μας εκδοχή του κλασικού. Απελευθερώσου από τα δεσμά ενός και μόνο θέματος, διότι το μυαλό σου κατακλύζεται από τόσες και τόσες σκέψεις.\n* **Πρόσθεσε εφαρμογές στον διακομιστή σου από το νέο [App Directory](https://discord.com/blog/app-directory-is-here-mods-and-admins).** Η κοινότητα Προγραμματιστών του Discord φτιάχνει απίστευτα πράγματα που εξυπηρετούν εσένα και τον διακομιστή σου. Και εμείς σκεφτόμαστε…δεν θα έπρεπε να ήταν ευκολότερο να τα βρίσκεις; Οπότε, τώρα είναι. Αν διαχειρίζεσαι έναν διακομιστή, πήγαινε στις Ρυθμίσεις διακομιστή για να ρίξεις μια ματιά.\n* **Τώρα η φωνητική συνομιλία Discord από το Xbox είναι εδώ για όλους.** ΝΑΙ, ΣΟΒΑΡΟΛΟΓΩ. Οι φίλοι σου θα μπορούν να δουν ποιο παιχνίδι παίζεις στην κονσόλα σου και ΠΛΕΟΝ ΘΑ ΜΠΟΡΕΙΤΕ ΝΑ ΜΙΛΑΤΕ ΜΕ ΦΩΝΗΤΙΚΗ ΣΥΝΟΜΙΛΙΑ DISCORD ΑΠΟ ΤΟ XBOX ΣΟΥ, ΟΠΩΣ ΜΑΣ ΤΟ ΖΗΤΑΤΕ ΕΔΩ ΚΑΙ ΧΡΟΝΙΑ. ΕΥΧΑΡΙΣΤΟΥΜΕ ΓΙΑ ΤΗΝ ΥΠΟΜΟΝΗ. Μάθε περισσότερα στο [blog](https://dis.gd/xbox-voice). \n\nΕνημερώσεις ρυθμίσεων {progress}\n======================\n\n* **Τώρα τα τυχαία μηνύματα φιλτράρονται.** Αν κάποιος με τον οποίο δεν είστε φίλοι σού στείλει ΑΜ, μπορείς να το δεις σε έναν ξεχωριστό φάκελο Αιτημάτων μηνυμάτων. Αν δεν σε πειράζει να λαμβάνεις μηνύματα από οποιονδήποτε, μπορείς να το [απενεργοποιήσεις](https://support.discord.com/hc/articles/7924992471191-Message-Requests).\n* **Μπορείς να διαχειριστείς τις ειδοποιήσεις Επισημάνσεων.** Μάθε τι συμβαίνει στους αγαπημένους σου διακομιστές—ή [και όχι](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications), αν δεν σου αρέσει αυτό. Όπως προτιμάς.\n* **Ενισχύσαμε τον εντοπισμό ανεπιθύμητης αλληλογραφίας στους διακομιστές Κοινότητας.** Αν κάποιος προσπαθήσει να στείλει ανεπιθύμητη αλληλογραφία με @mentions ή να δημοσιεύσει έναν σύνδεσμο απάτης, το AutoMod μπορεί να αποκλείσει τη δημοσίευση του μηνύματος. Οι διαχειριστές κοινότητας μπορούν να επεξεργαστούν αυτή τη δυνατότητα στις Ρυθμίσεις διακομιστή.\n* **Δες τις συσκευές στις οποίες είσαι συνδεδεμένος.** Τσέκαρε τις Ρυθμίσεις χρήστη › Συσκευές, ένα υπέροχο μέρος όπου μπορείς να αποσυνδεθείς από τον οικογενειακό υπολογιστή ή από ένα πανάρχαιο τηλέφωνο.\n\n\n---changelog---\ndate: "2022-11-01"\nlocale: "hi-in"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\nनई सुविधाएं {added marginTop}\n======================\n\n* **अब एक्टिविटी का भी मज़ा लें.** किसी भी वॉयस चैनल पर जाएं और तत्काल ही (क्योंकि रॉकेट की इमोजी जो है-आप तो समझते हैं) एक खास हैंगआउट के लिए कोई Watch Together प्लेलिस्ट या Putt Party गेम शुरू करें. आपके पास Nitro है? तब तो आपको एक्टिविटी के पूरे कैटलॉग मिलने के साथ अपने दोस्तों पर झुकने की ज़िम्मेदारी भी मिलेगी. पूरी कहानी जानने के लिए हमारे [ब्लॉग](https://discord.com/blog/server-activities-games-voice-watch-together) पर जाएं. \n* **पेश है Nitro Basic.** ये Nitro का सबसे छोटा वर्शन है जिसकी कीमत भी बहुत कम है. कहीं पर भी सारे इमोजी अनलॉक करें, ज़्यादा बड़ी फ़ाइलें अपलोड करके और भी बहुत कुछ करें. अब ज़्यादातर देशों में उपलब्ध है, और देश भी जुड़ रहे हैं.\n* **नया Nitro पर्क: प्रोफ़ाइल थीम.** अपनी प्रोफ़ाइल को खास बनाने के लिए रंगों की स्कीम चुनें. ये जल्दी ही उन सबकी यूज़र सेटिंग में उपलब्ध होगा जिनके पास Nitro है.\n* **सुनो, सुनो, सुनो, अब फ़ोरम चैनल भी आ गए हैं दोस्तो.** एक क्लासिक फ़ीचर अब नए रूप में. एक ही टॉपिक की ज़ंजीरों से खुद को आज़ाद करें, क्योंकि आपके दिमाग में अक्सर एक से ज़्यादा बातें और बहुत सारे खयाल होते हैं.\n* **नई [App Directory](https://discord.com/blog/app-directory-is-here-mods-and-admins) से सीधे अपने सर्वर पर ऐप जोड़ें.** Discord डिवेलपर कम्युनिटी ऐसी शानदार चीज़ें बनाती है जो आपके सर्वर को आपके लिए एकदम सही बना देती हैं. तो हम सोच रहे थे कि… उन्हें खोजना आसान होना चाहिए, है न? तो अब ऐसा हो चुका है. अगर आप किसी सर्वर को मैनेज करते हैं, तो बस सर्वर सेटिंग्स में जाएं और पता करें.\n* **Xbox पर Discord वॉयस अब सबके लिए उपलब्ध है.** हां, सच में. फ़्रेंड्स देख पाएंगे कि आप अपने कंसोल पर कौन सा गेम खेल रहे हैं और अब आप अपने Xbox से Discord वॉयस में उनसे बात कर सकेंगे, कई सालों से आपकी यही तो मांग थी. आपने इतना सब्र रखा इसके लिए धन्यवाद. इसके बारे में ज़्यादा जानकारी के लिए [ब्लॉग](https://dis.gd/xbox-voice) पर जाएं. \n\nसेटिंग के अपडेट {progress}\n======================\n\n* **अब रैंडम मैसेज फ़िल्टर हो जाते हैं.** अगर किसी ऐसे व्यक्ति ने आपको DM भेजा है जो आपकी फ़्रेंड लिस्ट में नहीं है, तो आपको वो मैसेज एक अलग मैसेज रिक्वेस्ट फ़ोल्डर में दिखाई देगा. अगर आप चाहते हैं कि हर कोई आपको मैसेज भेज सके, तो आप [इसे बंद कर सकते हैं](https://support.discord.com/hc/articles/7924992471191-Message-Requests).\n* **आप अपने हाइलाइट नोटिफ़िकेशन भी मैनेज कर सकते हैं.** आपके पसंदीदा सर्वर में क्या चल रहा है उसकी जानकारी रखें—या आपका मन नहीं है तो [ध्यान न दें](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications). जो मर्ज़ी करें.\n* **कम्युनिटी सर्वर में स्पैम का पता और अच्छी तरह लगाया जाएगा.** अगर किसी ने @mentions में स्पैम किया या किसी स्कैम का लिंक पोस्ट किया, तो AutoMod उन मैसेज को पोस्ट होने से पहले ही ब्लॉक कर देगा. सर्वर सेटिंग्स में जाकर कम्युनिटी के एडमिन इसे मैनेज कर सकते हैं.\n* **आपने जिन डिवाइस से लॉग इन किया है उन्हें देखें.** यूज़र सेटिंग › डिवाइस में जाकर आप अपने पारिवारिक कम्प्यूटर से या सदियों पुराने किसी फ़ोन से लॉग आउट कर सकते हैं.\n\n\n---changelog---\ndate: "2022-11-01"\nlocale: "hr-hr"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\nNove značajke {added marginTop}\n======================\n\n* **Aktivnosti su od sada s nama.** Pridruži se bilo kojem glasovnom kanalu i trenutno pokreni (radi se o raketi, razumiješ) popis za reprodukciju Watch Together ili igru Putt Party radi ugodnog druženja. Imaš Nitro? Dobit ćeš cijeli katalog Aktivnosti i teško će ti pasti što ćeš se morati praviti važnim pred prijateljima. Cijelu priču možeš pronaći na [blogu](https://discord.com/blog/server-activities-games-voice-watch-together). \n* **Predstavljamo Nitro Basic.** Povijesno najmanji Nitro za još manju cijenu. Otključaj sve emojije, prenosi veće datoteke i još mnogo toga. Od sada dostupno u većini država, a uskoro i u više njih.\n* **Nova posebna pogodnost za Nitro: Teme profila.** Odaberi shemu boja i istakni svoj profil. Uskoro dostupno u Korisničkim postavkama svima koji koriste Nitro.\n* **Pažnja, pažnja, dostupni su Kanali foruma i baš smo svi sretni, jelda?** Naša verzija klasika. Oslobodi se okova jedne teme jer imaš mnoštvo tema i previše misli.\n* **Na svoj server dodaj aplikacije putem nove opcije [App Directory](https://discord.com/blog/app-directory-is-here-mods-and-admins).** Zajednica developera za Discord stvara vrhunske stvari da bi tvoj server funkcionirao. A mi smo se malo pitali... ne bi li se serveri trebali pronaći lakše? Od sada se mogu. Ako upravljaš serverom, otvori Postavke servera i pogledaj što tamo ima.\n* **Discord Voice na Xbox-u sada je dostupan za sve.** DA, OZBILJAN SAM. Prijatelji mogu vidjeti koju igru igraš na svojoj konzoli i SADA MOŽEŠ RAZGOVARATI PUTEM USLUGE DISCORD VOICE PUTEM SVOG XBOX-A BAŠ ONAKO KAO ŠTO SI GODINAMA TRAŽIO. HVALA TI NA STRPLJENJU. Doznaj više na [blogu](https://dis.gd/xbox-voice). \n\nAžuriranja postavki {progress}\n======================\n\n* **Nasumične su poruke sada filtrirane.** Ako ti korisnik koji nije na popisu prijatelja pošalje direktnu poruku, možeš je vidjeti u odvojenoj mapi Zahtjevi za poruke. Ako ti ne smetaju poruke nepoznatih osoba, možeš [isključiti opciju](https://support.discord.com/hc/articles/7924992471191-Message-Requests).\n* **Možeš upravljati svojim obavijestima o istaknutom sadržaju.** Ostani u tijeku s trenutnim događajima na omiljenim serverima ili [ne](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications), ako ti se to ne sviđa. Radi po svojem.\n* **Poboljšano otkrivanje neželjenih poruka na Serverima zajednice.** Ako netko pokuša neželjeno označavati @spominjanja ili objaviti neželjenu poveznicu, AutoMod može blokirati objavu poruke. Administratori zajednice mogu upravljati tim opcijama tako da otvore Postavke servera.\n* **Možeš prikazivati uređaje na koje si prijavljen.** Pogledaj Korisničke postavke › Uređaji, divno mjesto gdje se možeš odjaviti iz obiteljskog računala ili prastarog mobitela.\n\n\n---changelog---\ndate: "2022-11-01"\nlocale: "hu-hu"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\nÚj funkciók {added marginTop}\n======================\n\n* **Mostantól a Tevékenységek funkció emeli a partik fényét.** Ha belépsz valamelyik hangcsatornára, fénysebességgel elindíthatsz egy Watch Together lejátszási listát vagy egy Putt Party játékot, hogy igazán emlékezetes legyen a lazulás. Van Nitro-előfizetésed? A komplett Tevékenységek katalógusból szemezgethetsz, a barátaid pedig garantáltan elsárgulnak majd az irigységtől. A [blogon](https://discord.com/blog/server-activities-games-voice-watch-together) elolvashatod a teljes sztorit. \n* **Bemutatjuk a Nitro Basic előfizetést.** Ez a Nitro legkompaktabb verziója, és az ára is igazán szerény. Az előfizetéssel többek között mindenhol feloldhatod az összes emotikont, és nagyobb fájlokat tölthetsz fel. A legtöbb országban már elérhető, és a lista hamarosan bővülni fog.\n* **Új Nitro-jutalom: profiltémák.** Válassz egy színpalettát a profilod kiemeléséhez. A funkció hamarosan minden Nitro-előfizető számára elérhető lesz a Felhasználói beállítások területen.\n* **Figyelem, figyelem… Megérkeztek a Fórumcsatornák.** Egy klasszikus formátum a saját stílusunkban. Ne korlátozd magad egyetlen témára: ennél sokkal több rejlik benned. Oszd meg a gondolataidat másokkal!\n* **Egyenesen az új [Alkalmazáskönyvtárból](https://discord.com/blog/app-directory-is-here-mods-and-admins) adhatsz hozzá alkalmazásokat a szerveredhez.** A Discord fejlesztői közössége nagyszerű megoldásokat állít össze, amelyekkel teljesen az igényeidre szabhatod a szervert. Úgy gondoltuk, ideje ezeket könnyebben hozzáférhetővé tenni, és már meg is valósítottuk az ötletet. Ha van olyan szerver, amelyet te kezelsz, lépj a Szerverbeállítások területre, és nézz körül!\n* **Most már mindenki számára elérhetők a Discord-hangcsevegések az Xboxon.** NEM CSALÁS, NEM ÁMÍTÁS. A barátaid láthatják, milyen játékkal játszol a konzolodon, és DISCORD-HANGCSEVEGÉST FOLYTATHATSZ AZ XBOXODRÓL. A FELHASZNÁLÓK ÉVEK ÓTA KÉRTÉK EZT A FEJLESZTÉST. MOST MEGÉRKEZETT. KÖSZÖNJÜK A TÜRELMET. További tájékoztatás a [blogon](https://dis.gd/xbox-voice). \n\nBeállításokkal kapcsolatos újdonságok {progress}\n======================\n\n* **Mostantól kiszűrjük a random üzeneteket.** Ha olyan személy küld neked közvetlen üzenetet, aki nem a barátod, a különálló Üzenetkérelmek mappában tekintheted meg, mit írt. Ha viszont nem bánod, ha bárki üzenetet tud küldeni neked, [kikapcsolhatod a beállítást](https://support.discord.com/hc/articles/7924992471191-Message-Requests).\n* **Kiemelt értesítéseket kezelhetsz.** Ha szeretnéd, folyamatosan figyelemmel kísérheted, mi történik a kedvenc szervereiden. Ha viszont [nincs](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications) igényed erre, nem kötelező használni ezt a funkciót. A döntés a te kezedben van.\n* **Mostantól még hatékonyabban fogjuk észlelni a kéretlen tartalmakat a közösségi szervereken.** Ha valaki kéretlen említésekkel (@mentions) próbálkozik, vagy kéretlen hivatkozást tesz közzé, az AutoMod megakadályozhatja az üzenet közzétételét. A közösségi adminok a Szerverbeállítások területen tudják kezelni ezt a funkciót.\n* **Megtekintheted, milyen eszközökön vagy bejelentkezve.** Lépj a Felhasználói beállítások › Eszközök területre. Ez egy igazán hasznos kis hely, ahol kijelentkezhetsz a családi gépről vagy az ősrégi telefonodról.\n\n\n---changelog---\ndate: "2022-11-01"\nlocale: "it"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\nNuove funzionalità {added marginTop}\n======================\n\n* **Le Attività si sono unite alla festa.** Entra in un qualsiasi canale vocale e lancia immediatamente (un po\' come un razzo) una playlist Watch Together o una partita Putt Party per spassartela in compagnia. Hai Nitro? Avrai a disposizione l\'intero catalogo delle Attività e il pesante fardello di impressionare i tuoi amici. Il [blog](https://discord.com/blog/server-activities-games-voice-watch-together) ti spiegherà tutto nei dettagli. \n* **Ti presentiamo Nitro Basic.** La versione in miniatura di Nitro, a un prezzo ancor più mini. Sblocca tutte le emoji ovunque, carica file più grandi e molto altro ancora. Ora disponibile nella maggior parte dei paesi, presto anche in altri.\n* **Un nuovo beneficio di Nitro: i temi del profilo.** Scegli uno schema di colori per mettere in risalto il tuo profilo. Disponibile a breve nelle Impostazioni utente per tutti gli abbonati a Nitro.\n* **Udite, udite, sono arrivati i canali forum.** La nostra interpretazione di un grande classico. Liberati dalle catene degli argomenti unici perché hai un universo interiore troppo vasto, e troppi pensieri, per avere limiti di questo tipo.\n* **Aggiungi app al tuo server tramite la nuova [App Directory](https://discord.com/blog/app-directory-is-here-mods-and-admins).** La community degli sviluppatori di Discord crea strumenti fantastici che facilitano la gestione del tuo server. E ci siamo detti... non dovrebbe essere più facile trovarli? Ora è così. Se gestisci un server, vai su Impostazioni del server per vedere di cosa si tratta.\n* **La chat vocale di Discord su Xbox è disponibile per tutti.** SÌ, DICO SUL SERIO. Gli amici possono vedere a cosa stai giocando sulla tua console e ORA PUOI PARLARE NELLA CHAT VOCALE DI DISCORD DALLA TUA XBOX, COME CI STAVATE CHIEDENDO DA ANNI. GRAZIE PER LA VOSTRA PAZIENZA. Scopri di più sul [blog](https://dis.gd/xbox-voice). \n\nAggiornamenti delle impostazioni {progress}\n======================\n\n* **I messaggi da sconosciuti ora vengono filtrati.** Se qualcuno che non è tuo amico ti invia un messaggio diretto, potresti visualizzarlo in una cartella separata di richieste di messaggio. Se non ti dà fastidio ricevere messaggi da chiunque, puoi [disattivare il servizio](https://support.discord.com/hc/articles/7924992471191-Message-Requests).\n* **Puoi gestire le tue notifiche degli highlight.** Tieniti al passo con quello che succede nei tuoi server preferiti, oppure [non farlo](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications), se non ti va. La scelta è tua.\n* **Il rilevamento di spam nei server di community è stato migliorato.** Se qualcuno cerca di spammare @menzioni o di postare un link scam, AutoMod può bloccare la pubblicazione del messaggio. Gli amministratori della community possono gestire questa funzione nelle Impostazioni del server.\n* **Visualizza i dispositivi in cui hai effettuato l\'accesso** Vai in Impostazioni utente › Dispositivi, un luogo meraviglioso dove puoi disconnetterti dal computer di famiglia o da un telefono vecchio di milioni di anni.\n\n\n---changelog---\ndate: "2022-11-01"\nlocale: "ja"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\n新機能 {added marginTop}\n======================\n\n* **アクティビティがパーティーに参加しました。**好きなボイスチャンネルに参加すれば、すぐにWatch TogetherプレイリストやゴルフゲームのPutt Partyをローンチ（ロケットの打ち上げみたいな感じで、こう）して、仲間と楽しい時間を過ごすことができます。Nitroに登録、してますか？　登録者の皆さんは全種類のアクティビティを利用でき、友達にドヤ顔で自慢せねばならぬという重い責務を負います。全貌は[ブログ](https://discord.com/blog/server-activities-games-voice-watch-together)でどうぞ。 \n* **Nitro Basicのご紹介です**。史上いちばんちっちゃいNitroを、さらにちっちゃい価格でご提供。どこでもすべての絵文字をアンロック、ファイルアップロード上限UPなどなど。現在、ほとんどの国でご利用いただけます。今後も順次展開予定。\n* **新たなNitro特典：プロフィールテーマ**。色の組み合わせを選んで、プロフィールにアクセントを。Nitroを持つ者たちすべてのユーザー設定に近日降臨予定。\n* **聴くがよい、聴くがよい、フォーラムチャンネルの降臨である……よよいのよい**。古典的機能をDiscord流に改新。単一テーマなる枷より己を解き放て。汝は多面的存在であり、頭の中でいろいろ考えていることが多すぎるがゆえに。\n* **新登場の[App Directory](https://discord.com/blog/app-directory-is-here-mods-and-admins)からサーバーにアプリを直接追加しちゃおう**。Discordのデベロッパーコミュニティは、あなたのサーバーにぴったり役立つ素敵なものをたくさん作っています。そこで思ったんです……そういうアプリをもっと簡単に探せるようにしないとじゃない？　って。というわけで、登場です。サーバー管理者の皆さんは、「サーバー設定」から今すぐチェックしてくださいね。\n* **XboxでDiscordボイスチャットがリリースされました**。はい、マジです！　今、Xboxでは、あなたがコンソールでプレイしているゲームタイトルをフレンドが確認できます。そしてとうとう、これまでずっと皆さんからリクエストいただいていたとおり、Xboxから直接Discordのボイスチャットに参加できるようになりました！！　お待ちいただきありがとうございました！！！　詳しくは[ブログ](https://dis.gd/xbox-voice)でね。 \n\n設定の更新事項 {progress}\n======================\n\n* **唐突なメッセージがフィルタリングされるようになりました**。フレンドではない誰かからDMが来た場合、別のメッセージ・リクエストフォルダに表示される可能性があります。別に誰からメッセが来てもいいよ～という人は、設定を[オフにできます](https://support.discord.com/hc/articles/7924992471191-Message-Requests)。\n* **ハイライト通知を管理できるようになりました。**お気に入りのサーバーでの出来事を何ひとつ見逃さないっ！　――あるいはそういうのが嫌なら、[堂々と見逃す](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications)。あなたはあなたらしく生きて。\n* **コミュニティサーバーのスパム検出機能を強化しました。**もし@mentionsをスパムしようとしたり、詐欺リンクを貼ろうとする人がいたりしたら、AutoModがメッセージをブロックし、投稿できないようにします。コミュニティ管理者はこの設定を「サーバー設定」で調整できます。\n* **ログインしているデバイスを確認できるようになりました。** 「ユーザー設定」 › 「デバイス」へどうぞ。ここは素敵なところ。家族共用のパソコンや百万年前に使うのやめた携帯からログアウトできます。\n\n\n---changelog---\ndate: "2022-11-01"\nlocale: "ko"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\n새 기능 {added marginTop}\n======================\n\n* **활동이 생겼어요.** 아무 음성 채널에 들어가서 로켓답게 즉시 Watch Together 재생목록 또는 Putt Party 게임을 시작하고 아늑하게 어울리세요. Nitro가 있나요? 활동 카탈로그 전체가 제공되니 친구들에게 꼭 자랑하세요. [블로그](https://discord.com/blog/server-activities-games-voice-watch-together)에서 자세히 알아볼 수 있어요. \n* **Nitro Basic이 나왔어요.** 가장 작은 Nitro를 가장 저렴한 가격에 드려요. 모든 이모티콘을 어디서나 사용, 대용량 업로드 등 혜택이 있어요. 대부분의 국가에서 판매하며 곧 더 많은 국가에 출시할 거예요.\n* **새로운 Nitro 특전: 프로필 테마.** 색상 구성을 선택해 프로필을 강조하세요. 곧 모든 Nitro 사용자의 사용자 설정에 출시될 거예요.\n* **포럼 채널이 왔소이다...** 클래식을 재현해봤어요. 하나의 주제에만 매이지 말고 자유롭게 이야기하세요. 여러분은 너무 많은 생각과 개성을 가지고 있으니까요.\n* **새로운 [App Directory](https://discord.com/blog/app-directory-is-here-mods-and-admins)에서 즉시 서버에 앱을 추가하세요.** Discord 개발자 커뮤니티는 서버 운영을 간소화하는 훌륭한 도구를 만들어요. 그러니까... 그런 도구를 찾기 쉬워야겠죠? 이제 쉬울 거예요. 서버 운영자라면 서버 설정에서 확인해보세요.\n* **Xbox의 Discord 음성을 이제 누구나 사용할 수 있어요.** 정말이랍니다. 이제부터 콘솔에서 친구들이 플레이하고 있는 게임을 확인할 수 있고, 여러분이 몇 년 동안 요청하신 대로 Xbox에서 Discord로 대화할 수 있어요. 기다려주셔서 고마워요. [블로그](https://dis.gd/xbox-voice)에서 자세히 알아보세요. \n\n설정 업데이트 {progress}\n======================\n\n* **이제 랜덤 메시지가 필터링돼요.** 친구가 아닌 사람이 다이렉트 메시지를 보내면 별도의 메시지 요청 폴더에서 볼 수 있어요. 모르는 사람의 메시지를 받고 싶다면 [이 기능을 끄세요](https://support.discord.com/hc/articles/7924992471191-Message-Requests).\n* **하이라이트 알림을 관리할 수 있어요.** 좋아하는 서버의 최신 소식을 볼지, [안 볼지](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications) 선택할 수 있어요. 선택은 자유예요.\n* **커뮤니티 서버의 스팸 감지 기능을 강화했어요.** @mentions을 스팸하거나 사기성 링크를 게시하려고 하면, AutoMod가 메시지 포스트를 차단할 수 있어요. 커뮤니티 관리자가 서버 설정에서 이 기능을 관리할 수 있어요.\n* **로그인한 기기를 확인할 수 있어요.** 사용자 설정 › 기기를 확인해보세요. 가족 컴퓨터나 오래된 휴대폰에서 로그아웃할 수 있어요.\n\n\n---changelog---\ndate: "2022-11-01"\nlocale: "lt-lt"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\nNaujos funkcijos {added marginTop}\n======================\n\n* **Pasisveikinkite su veiklomis.** Keliauk į bet kurį balso kanalą ir iškart paleisk (kaip raketą – nevykęs juokelis, ar ne?) grojaraštį Watch Together arba žaidimą Putt Party smagiam laiko praleidimui. Turi Nitro? Tada tau pasiekiamas visas veiklų katalogas ir pati sunkiausia dalis – pasimaivyti prieš draugus. Apie tai išsamiau rasi [tinklaraštyje](https://discord.com/blog/server-activities-games-voice-watch-together). \n* **Pristatome Nitro Basic.** Mažiausia Nitro versija už dar mažesnę kainą. Gauk visus jaustukus bet kur, įkelk didesnius failus ir ne tik. Dabar – daugumoje šalių, sąrašas netrukus pasipildys.\n* **Naujas Nitro pranašumas: profilio temos.** Pasirink savo profilio spalvų schemą. Netrukus bus pasiekiama naudotojo nustatymuose visiems, kas turi Nitro.\n* **Jūsų pageidavimu – Forumų kanalai.** Mūsų patobulinta klasika. Išsilaisvink iš vienos temos pančių – juk turi daugybę minčių pačiomis įvairiausiomis temomis.\n* **Pridėk programėlių prie serverio tiesiai iš naujojo katalogo [App Directory](https://discord.com/blog/app-directory-is-here-mods-and-admins).** Discord programuotojų bendruomenė kuria nuostabių dalykų, paįvairinančių serverius. Tada pagalvojom: kažkaip sudėtinga juos rasti. Todėl šiek tiek pasidarbavome. Jei tvarkai kokį nors serverį, nueik į serverio nustatymus ir užmesk akį.\n* **Discord pokalbiai balsu per Xbox jau prieinami kiekvienam.** ČIA RIMTAI, NEJUOKAUJU. Draugai gali matyti, kokį žaidimą žaidi konsolėje, ir jau GALI PRISIJUNGTI PRIE JŲ PER DISCORD POKALBĮ BALSU TIESIAI IŠ XBOX – KAIP DAUGELIS PRAŠĖ JAU NE VIENERIUS METUS. AČIŪ UŽ KANTRYBĘ. Sužinok daugiau [tinklaraštyje](https://dis.gd/xbox-voice). \n\nNustatymų naujienos {progress}\n======================\n\n* **Atsitiktinės žinutės dabar filtruojamos.** Jei kas nors ne iš draugų išsiųs tau AŽ, ją matysi atskirame aplanke Žinučių užklausos. Jei tau netrukdo žinutės nuo bet ko, gali šią funkciją [išjungti](https://support.discord.com/hc/articles/7924992471191-Message-Requests).\n* **Gali tvarkyti svarbiausių akcentų pranešimus.** Žinok viską, kas svarbaus vyksta tavo mėgstamuose serveriuose – arba [nežinok](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications), jei nenori. Nuspręsk pats (pati).\n* **Dar geresnis brukalo aptikimas bendruomenės serveriuose.** Jei kas nors bando siųsti brukalą naudodamasis @paminėjimais arba įkelti apgaulingą nuorodą, AutoMod tokią žinutę gali užblokuoti. Šią funkciją serverio nustatymuose gali keisti bendruomenės administratoriai.\n* **Peržiūrėk įrenginius, kuriuose esi prisijungęs.** Eik į Naudotojo nustatymai › Įrenginiai – čia galėsi atsijungti iš šeimos kompiuterio ar milijono metų senumo telefono.\n\n\n---changelog---\ndate: "2022-11-01"\nlocale: "nb-no"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\nNytt innhold {added marginTop}\n======================\n\n* **Aktiviteter er med på moroa.** Gå til en talekanal for å starte en Watch Together-spilleliste eller en morsom runde med Putt Party. Har du Nitro? Du får tilgang til hele Aktiviteter-katalogen og får det tunge ansvaret med å underholde vennene dine. På [bloggen](https://discord.com/blog/server-activities-games-voice-watch-together) finner du alt du trenger å vite. \n* **Vi presenterer Nitro Basic.** Den minste versjonen av Nitro, for en minipris. Du låser opp alt av emojier overalt, kan laste opp større filer og mye mer. Tilgjengelig i de fleste land, og flere kommer snart til.\n* **Ny Nitro-fordel: Profiltemaer.** Velg et fargetema for å gjøre profilen din stiligere. Alle som har Nitro, får snart tilgang til dette i brukerinnstillingene.\n* **Vi har fått forumkanaler!** Dette er vår variant av klassikeren. Du er ikke bundet til ett emne, men kan diskutere alt hjertet renner over med.\n* **Legg til apper i serveren rett fra nye [App Directory](https://discord.com/blog/app-directory-is-here-mods-and-admins).** Discords utviklerfellesskap lager flotte ting som gjør at det blir enda morsommere og mer effektivt å bruke serveren. Men burde det ikke vært lettere å finne alt? Nå er det blitt det. Hvis du administrerer en server, kan du gå til Innstillinger for å ta en titt.\n* **Discord Voice på Xbox er tilgjengelig for alle.** JA, DET ER SANT. Vennene dine kan se hva du spiller på konsollen din, og DU KAN SNAKKE MED DEM PÅ DISCORD FRA XBOX-EN DIN, AKKURAT SOM DU HAR HATT LYST TIL I ÅREVIS. TAKK FOR TÅLMODIGHETEN. Du finner mer info på [bloggen](https://dis.gd/xbox-voice). \n\nOppdatering av innstillinger {progress}\n======================\n\n* **Nå filtreres meldinger fra brukere du ikke kjenner.** Hvis noen du ikke er venn med, sender deg en direktemelding, kan du velge å få den i en egen mappe: Meldingsforespørsler. Hvis du synes det er greit at folk sender deg meldinger, kan du [slå av funksjonen](https://support.discord.com/hc/articles/7924992471191-Message-Requests).\n* **Du kan administrere varsler av høydepunkter.** Få med deg hva som skjer på favorittserverne dine – eller [ikke](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications), hvis du helst vil slippe. Alle er ulike.\n* **Forbedret spamregistrering i fellesskapsservere.** Hvis noen prøver å spamme @mentions eller legge ut en farlig lenke, kan AutoMod blokkere meldingen, slik at den ikke publiseres. Fellesskapets administratorer kan justere dette i serverinnstillingene.\n* **Vis enheter der du er logget på.** Sjekk Brukerinnstillinger > Enheter, et nydelig sted der du kan logge ut på familiens datamaskin eller på en telefon du hadde for en million år siden.\n\n\n---changelog---\ndate: "2022-11-01"\nlocale: "pl"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\nNowe funkcje {added marginTop}\n======================\n\n* **Aktywności w Discordzie.** Wejdź na dowolny kanał głosowy i natychmiast odpal (niczym statek kosmiczny – łapiesz?) playlistę Watch Together lub grę Putt Party, aby miło spędzić czas z innymi. Masz Nitro? W takim razie zyskasz dostęp do pełnego katalogu aktywności i prawo do popisywania się przed znajomymi. Szczegółowe informacje znajdziesz na [blogu](https://discord.com/blog/server-activities-games-voice-watch-together). \n* **Przedstawiamy Nitro Basic.** Najmniejsza wersja Nitro w jeszcze niższej cenie. Odblokuj wszystkie emoji na każdym serwerze, przesyłaj większe pliki i zyskaj inne korzyści. Plan Nitro Basic jest dostępny w większości krajów, a wkrótce pojawi się w dodatkowych lokalizacjach.\n* **Nowa korzyść Nitro: motywy profilu.** Wybierz schemat kolorów, aby wyróżnić swój profil. Funkcja dostępna wkrótce w ustawieniach użytkownika dla wszystkich posiadaczy Nitro.\n* **Nadeszły kanały forum.** Tradycyjna funkcja w discordowym wydaniu. Uwolnij się od ograniczeń pojedynczego tematu – albowiem są w Tobie niezliczone myśli.\n* **Dodawaj aplikacje do serwera z poziomu nowego [App Directory](https://discord.com/blog/app-directory-is-here-mods-and-admins).** Społeczność developerów Discorda tworzy wspaniałe narzędzia do serwerów. Postanowiliśmy ułatwić ich wyszukiwanie. Jeśli zarządzasz serwerem, przejdź do ustawień serwera i wypróbuj tę funkcję.\n* **Kanał głosowy Discorda na Xboxie jest teraz dostępny dla wszystkich.** TAK, TO PRAWDA. Teraz znajomi widzą, w jaką grę grasz na konsoli, i MOŻESZ ROZMAWIAĆ NA KANALE GŁOSOWYM DISCORDA Z POZIOMU XBOXA – TO FUNKCJA, O KTÓRĄ GRACZE PROSILI OD LAT. DZIĘKUJEMY ZA CIERPLIWOŚĆ. Więcej informacji można znaleźć na [blogu](https://dis.gd/xbox-voice). \n\nAktualizacje ustawień {progress}\n======================\n\n* **Wiadomości od nieznajomych są teraz filtrowane.** Jeśli ktoś, kto nie jest Twoim znajomym, wyśle Ci prywatną wiadomość, możesz wyświetlić ją w osobnym folderze Żądania dotyczące wiadomości. Jeśli nie masz nic przeciwko otrzymywaniu wiadomości od nieznajomych, możesz [wyłączyć tę funkcję](https://support.discord.com/hc/articles/7924992471191-Message-Requests).\n* **Możesz zarządzać powiadomieniami dotyczącymi wyróżnionych.** Bądź na bieżąco z aktualnościami na ulubionych serwerach – lub [nie bądź](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications) – wybór należy do Ciebie.\n* **Udoskonalone wykrywanie spamu na serwerach społeczności.** Jeśli ktoś spróbuje spamować poprzez @wzmianki lub opublikować oszukańczy link, AutoMod może zablokować wiadomość. Administratorzy społeczności mogą zarządzać tą funkcją w ustawieniach serwera.\n* **Można teraz sprawdzić urządzenia, na których się zalogowano.** Sprawdź menu Ustawienia użytkownika › Urządzenia – to wspaniałe miejsce, w którym możesz wylogować się z rodzinnego komputera lub tysiącletniego telefonu.\n\n\n---changelog---\ndate: "2022-11-01"\nlocale: "pt-BR"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\nNovos recursos {added marginTop}\n======================\n\n* **As Atividades chegaram para arrasar.** Entre no canal de voz e inicie de imediato uma playlist de Watch Together ou Putt Party de um jogo relaxante para ficar de boa. Tem Nitro? Você ganha acesso ao catálogo completo de Atividades, mais o pesado fardo de se exibir para seus amigos. O [blog](https://discord.com/blog/server-activities-games-voice-watch-together) tem todos os detalhes. \n* **Apresentamos o Nitro Basic.** Nossa menor versão do Nitro, por um preço ainda menor. Desbloqueie todos os emojis em todo lugar, faça upload de arquivos maiores e muito mais. Já disponível na maioria dos países e muitos mais, em breve.\n* **Nova vantagem Nitro: Temas de Perfil.** Escolha uma paleta de cores para destacar seu Perfil. Em breve disponível nas Configurações de Usuário para todos que possuem Nitro.\n* **Ouçam, ouçam todos, os Canais de Fórum chegaram.** Nossa versão para um clássico. Liberte-se das amarras de um único assunto, pois você contém multitudes e pensamentos demais.\n* **Adicione apps ao seu servidor usando o novo [App Directory](https://discord.com/blog/app-directory-is-here-mods-and-admins).** A comunidade de desenvolvedores do Discord cria coisas incríveis que fazem seu servidor trabalhar por você. Aí a gente ficou pensando se não deveria ser mais fácil encontrar essas coisas... Então agora é! Se você gerencia um servidor, vá até as Configurações do Servidor para conferir.\n* **O bate-papo por voz no Xbox chegou para todo mundo.** SIM, ESTOU FALANDO SÉRIO. Amigos podem ver o que você está jogando no console e VOCÊS PODEM CONVERSAR NO BATE-PAPO POR VOZ DO DISCORD NO SEU XBOX, COMO VOCÊS NOS PEDEM HÁ ANOS. AGRADECEMOS PELA PACIÊNCIA. Saiba mais no [blog](https://dis.gd/xbox-voice). \n\nAtualizações de configurações {progress}\n======================\n\n* **Mensagens aleatórias agora são filtradas.** Se alguém que não é seu amigo envia uma MD, você pode ver em um diretório separado de solicitação de mensagens. Se não se importa com mensagens de qualquer um, pode [desativar](https://support.discord.com/hc/articles/7924992471191-Message-Requests).\n* **Você pode gerenciar suas notificações de Destaque.** Acompanhe o que rola nos seus servidores favoritos... ou [não](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications), se não quiser. Você decide.\n* **Tunamos o sistema de detecção de spam nos Servidores da Comunidade.** Se alguém tentar spammar @menções ou postar link de scan, o AutoMod pode bloquear a mensagem antes que seja postada. Administradores de comunidade podem gerenciar isso nas Configurações do Servidor.\n* **Veja dispositivos nos quais entrou com a conta.** Configura Configurações de Usuário › Dispositivos, um local maravilhoso onde você pode sair do computador da família ou do celular pré-histórico.\n\n\n---changelog---\ndate: "2022-11-01"\nlocale: "ro-ro"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\nCaracteristici noi {added marginTop}\n======================\n\n* **Activitățile s-au alăturat petrecerii.** Intră pe orice canal de voce și lansează instantaneu (ca o rachetă, te prinzi tu) un playlist Watch Together sau un joc Putt Party, dacă vrei o întâlnire relaxată. Ai Nitro? Poți accesa tot catalogul de Activități și ai datoria solemnă de a te da mare în fața prietenilor. Citește toată povestea [pe blog](https://discord.com/blog/server-activities-games-voice-watch-together). \n* **Îți prezentăm Nitro Basic.** Cea mai mică versiune de Nitro, acum la un preț și mai mic. Deblochează toate emojiurile ca să le folosești oriunde, încarcă fișiere mai mari și nu numai. Nitro Basic e acum disponibil în majoritatea țărilor și va fi disponibil în și mai multe locuri în curând.\n* **Nou avantaj Nitro: temele de profil.** Alege o combinație de culori pentru a-ți scoate profilul în evidență. Opțiunea va fi disponibilă în curând în Setări utilizator pentru toți cei care au Nitro.\n* **Cine are urechi să audă! Canalele forum sunt aici!** Versiunea noastră a unui concept clasic. Eliberează-te de restricțiile unui singur subiect; doar ești o persoană prea complexă, cu prea multe gânduri.\n* **Adaugă aplicații pe server direct din noul [App Directory](https://discord.com/blog/app-directory-is-here-mods-and-admins).** Comunitatea de dezvoltatori Discord creează lucruri grozave, cu ajutorul cărora îți faci serverul să meargă fix cum vrei. Așa că ne gândeam... nu c-ar fi bine să le și găsești mai ușor? De-acum, așa și e. Dacă gestionezi un server, mergi la Setările serverului ca să vezi despre ce e vorba.\n* **Toată lumea poate folosi acum canalele de voce Discord pe Xbox.** DA, PE BUNE. Prietenii tăi pot vedea ce joci pe consolă, iar acum POȚI SĂ VORBEȘTI CU EI PE CANALELE DE VOCE DE PE XBOX, AȘA CUM VREI DE ANI DE ZILE ÎNCOACE. ÎȚI MULȚUMIM PENTRU RĂBDARE. Află mai multe de pe [blog](https://dis.gd/xbox-voice). \n\nActualizări setări {progress}\n======================\n\n* **De acum încolo, mesajele primite aleatoriu vor fi filtrate.** Dacă cineva care nu se află în lista ta de prieteni îți trimite un mesaj direct, vei vedea mesajul într-un folder separat, Solicitări de mesaje. Dacă nu te deranjează să primești mesaje de la oricine, poți [dezactiva opțiunea](https://support.discord.com/hc/articles/7924992471191-Message-Requests).\n* **Îți poți gestiona notificările despre elementele importante.** Fii mereu la curent cu ce se petrece pe serverele tale favorite – sau [nu](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications), dacă n-ai chef. Cum vrei tu.\n* **Am amplificat detectarea spamului pe serverele comunitare.** Dacă cineva încearcă să spameze @mentions sau să posteze un link către un conținut înșelător, AutoMod poate bloca mesajul, nelăsându-l să fie postat. Administratorii comunității pot gestiona setarea din Setările serverului.\n* **Vezi dispozitivele de pe care te-ai conectat.** Intră pe Setări utilizator › Dispozitive, un loc minunat de unde poți să te deconectezi de pe calculatorul familiei sau de pe un telefon de acum o mie de ani.\n\n\n---changelog---\ndate: "2022-11-01"\nlocale: "ru"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\nНовые функции {added marginTop}\n======================\n\n* **На нашем празднике жизни появились активности!** Заглянув в любой голосовой канал, вы сможете мгновенно запустить (как ракету) плейлист «Watch Together» или игру «Putt Party» и славно провести время. Кстати, а есть ли у вас Nitro? Если да, то вам будет доступен полный каталог активностей, и вы сможете выпендриваться перед друзьями. Все подробности в нашем [блоге](https://discord.com/blog/server-activities-games-voice-watch-together). \n* **Встречайте Nitro Basic!** Самый скромный вариант подписки Nitro по ещё более скромной цене. Вы сможете использовать все эмодзи где угодно и загружать файлы большего размера, а также получите ряд других преимуществ. Этот тариф уже доступен во многих странах, и скоро их станет больше.\n* **Новый бонус Nitro: темы профиля.** Украсьте свой профиль, выбрав для него цветовую палитру! Темы скоро появятся в разделе «Настройки пользователя» у всех подписчиков Nitro.\n* **Внимание, внимание, мы исполнили ваше желание!** В Discord появились каналы форумов — наш вариант классических платформ для общения. Выберитесь из ловушки одной-единственной темы обсуждения, ведь в вашей голове полным-полно разных мыслей и идей!\n* **Добавляйте приложения на свой сервер с помощью нового [каталога приложений (App Directory)](https://discord.com/blog/app-directory-is-here-mods-and-admins).** Сообщество разработчиков Discord создаёт крутые штуки, чтобы вам было проще управлять сервером. Ну и мы подумали… почему бы не облегчить их поиск? И облегчили! Если у вас есть права на управление сервером, откройте его настройки и загляните в каталог.\n* **Голосовые каналы Discord на Xbox стали доступны всем пользователям.** НЕТ, ЭТО НЕ ШУТКА ТАКАЯ. Теперь ваши друзья будут видеть, какую игру вы запустили на своей консоли, а ВЫ СМОЖЕТЕ ОБЩАТЬСЯ С НИМИ В ГОЛОСОВОМ ЧАТЕ DISCORD НА XBOX, ПОТОМУ ЧТО ОЧЕНЬ ДОЛГО ЖДАЛИ ЭТУ ФУНКЦИЮ. Спасибо вам за терпение! Подробности читайте в [блоге](https://dis.gd/xbox-voice). \n\nОбновления настроек {progress}\n======================\n\n* **Включена фильтрация случайных сообщений.** Если кто-то, не являющийся вашим другом, отправит вам личное сообщение, оно появится в отдельной папке «Запросы общения». Если вы не против получать сообщения от незнакомых людей, смело [отключайте](https://support.discord.com/hc/articles/7924992471191-Message-Requests) эту функцию.\n* **Теперь вы можете управлять уведомлениями о важных событиях.** Следите за тем, что происходит на ваших любимых серверах, или [игнорируйте](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications) их, если вам такое не по душе. Хозяин — барин.\n* **Усилена система обнаружения спама на серверах сообществ.** Если кто-то попытается спамить @упоминаниями или ссылками на мошеннические сайты, Автомод заблокирует публикацию таких сообщений. Администраторы сообществ могут управлять этой функцией в настройках сервера.\n* **Узнайте, на каких устройствах вы выполнили вход.** Для этого перейдите в раздел «Настройки пользователя» > «Устройства». В этом чудесном местечке вы сможете выйти из своей учётной записи на семейном компьютере или древнем смартфоне.\n\n\n---changelog---\ndate: "2022-11-01"\nlocale: "es-ES"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\nNuevas características {added marginTop}\n======================\n\n* **Las Actividades se unen a la diversión.** Entrad en cualquier canal de voz y activad (porque son actividades, ¿lo pilláis?) al instante una lista de reproducción de Watch Together o una partida de Putt Party para pasar un rato agradable. ¿Tenéis Nitro? Obtendréis el catálogo completo de Actividades y la pesada carga de fardar de ello delante de vuestros amigos. Podéis ver la historia completa en el [blog](https://discord.com/blog/server-activities-games-voice-watch-together). \n* **Presentamos Nitro Basic.** Nuestra versión más reducida de Nitro, por un precio aún menor. Desbloquead todos los emojis en todas partes, subid archivos de mayor tamaño y mucho más. Ya disponible en la mayoría de países y, muy pronto, en más.\n* **Nueva ventaja de Nitro: temas de perfil.** Elegid una combinación de colores para hacer destacar vuestro perfil. Disponible muy pronto en Ajustes de usuario para quienes tengan Nitro.\n* **Se hace saber, se hace saber... Los canales de foro están al caer.** Nuestra versión de un clásico. Liberaos de los grilletes de hablar de un solo tema, ya que seguro que tenéis muchos en la cabeza y varias opiniones al respecto.\n* **Añadid aplicaciones a vuestro servidor desde el nuevo [App Directory](https://discord.com/blog/app-directory-is-here-mods-and-admins).** La comunidad de desarrolladores de Discord crea cosas increíbles que permiten sacar el máximo partido a vuestro servidor. Así que nos preguntamos: ¿por qué no hacemos que estas aplicaciones sean más fáciles de encontrar? Y ahora lo son. Si gestionáis un servidor, id a Ajustes del servidor para echar un vistazo.\n* **El chat de voz de Discord en Xbox ya está disponible para todo el mundo.** SÍ, VA EN SERIO. Vuestros amigos podrán ver a qué estáis jugando en vuestra consola y, ahora, PODRÉIS HABLAR CON ELLOS EN EL CHAT DE VOZ DE DISCORD DESDE VUESTRA XBOX, TAL Y COMO HABÉIS PEDIDO DURANTE AÑOS. MUCHAS GRACIAS POR VUESTRA PACIENCIA. Más información en el [blog](https://dis.gd/xbox-voice). \n\nActualizaciones de ajustes {progress}\n======================\n\n* **Ahora se filtran los mensajes de desconocidos.** Si alguien que no es vuestro amigo os envía un MD, podréis verlo en una carpeta separada de solicitudes de mensajes. Si no os molesta que os manden mensajes personas desconocidas, podéis [desactivar esta función](https://support.discord.com/hc/articles/7924992471191-Message-Requests).\n* **Ya podéis gestionar vuestras notificaciones de momentos destacados.** ¡Manteneos al tanto de lo que ocurre en vuestros servidores favoritos! O [no](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications), si es que no os interesa. Como vosotros queráis.\n* **Se ha reforzado la detección de spam en los servidores de comunidad.** Si alguien intenta hacer spam con @mentions o publicar un enlace fraudulento, AutoMod puede bloquear el mensaje para que no se publique. Los administradores de comunidades pueden gestionar esta función en los Ajustes del servidor.\n* **Mirad los dispositivos en los que habéis iniciado sesión.** Id a Ajustes de usuario › Dispositivos, un lugar maravilloso en el que podréis cerrar la sesión que teníais abierta en el ordenador familiar o en aquel teléfono móvil antiguo que ya no usáis.\n\n\n---changelog---\ndate: "2022-11-01"\nlocale: "sv-SE"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\nNya funktioner {added marginTop}\n======================\n\n* **Aktiviteter kom just in genom dörren.** Hoppa in i en röstkanal och starta (motorerna) en Watch Together-videolista eller en Putt Party-omgång för en mysig kväll. Har du Nitro? Då får du hela katalogen med Aktiviteter och den tunga bördan av att kunna spänna dig framför dina vänner. Allt finns att läsa i [bloggen](https://discord.com/blog/server-activities-games-voice-watch-together). \n* **Låt oss presentera Nitro Basic.** Vår minsta version av Nitro för ett ännu mindre pris. Lås upp alla emojier överallt, ladda upp större filer och annat. Nu tillgängligt i de flesta länder, fler snart.\n* **Ny Nitro-förmån: Profilteman.** Välj ett färgtema för att dekorera din profil. Snart tillgängligt i Användarinställningar för alla som har Nitro.\n* **Hör upp, hör upp, Forumkanalerna är här ...** Vår version av en klassiker. Gör dig fri från att vara fjättrad av ett enda ämne, för du har så mycket inom dig och alldeles för många tankar.\n* **Lägg till appar på din server rätt från vårt nya [App Directory](https://discord.com/blog/app-directory-is-here-mods-and-admins).** Discords utvecklarcommunity skapar grymma saker som gör att din server fungerar för dig. Och vi tänkte liksom … borde de inte vara lättare att hitta? Så nu är de det. Om du sköter en server kan du gå till dina Serverinställningar och kolla in det.\n* **Nu är Discords röstchatt på Xbox här för alla.** JA, JAG MENAR ALLVAR. Dina vänner kan se vilket spel du spelar på din konsol och NI KAN NU PRATA I DISCORDS RÖSTCHATT FRÅN DIN XBOX, PRECIS SOM NI HAR BETT OM I ÅRATAL. TACK FÖR TÅLAMODET. Läs mer på [bloggen](https://dis.gd/xbox-voice). \n\nInställningsuppdateringar {progress}\n======================\n\n* **Nu filtreras slumpmässiga meddelanden.** Om någon som inte är din vän skickar ett DM till dig, kan du se det i en separat mapp för meddelandeförfrågningar. Om du inte har något emot att få meddelanden från vem som helst, kan du [stänga av det](https://support.discord.com/hc/articles/7924992471191-Message-Requests).\n* **Du kan nu hantera dina Höjdpunktsaviseringar.** Håll koll på vad som händer på dina favoritservrar – eller [inte](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications), om du inte vill. Du gör som du känner för.\n* **Vi har biffat upp spamidentifieringen på communityservrar.** Om någon försöker spamma @omnämningar eller posta en blufflänk kan AutoMod blockera meddelandet och hindra det från att postas. Communityadministratörer kan sköta det här i Serverinställningar.\n* **Visa vilka enheter du är inloggad på.** Kolla in Användarinställningar › Enheter: ett fantastiskt ställe där du kan logga ut från familjens dator eller en miljoner år gammal telefon.\n\n\n---changelog---\ndate: "2022-11-01"\nlocale: "th-th"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\nฟีเจอร์ใหม่ {added marginTop}\n======================\n\n* **กิจกรรมมาเยือนปาร์ตี้แล้ว** เข้าไปในช่องสำหรับแชทด้วยเสียงใดก็ได้และพุ่งทะยานไป (เพราะเป็นรูปจรวดไงล่ะ) เปิดเพลย์ลิสต์ Watch Together หรือเกม Putt Party ทันทีเพื่อพบปะสังสรรค์กันอย่างอบอุ่นเป็นกันเอง ถ้าหากมี Nitro แล้ว คุณจะได้รับแค็ตตาล็อกกิจกรรมทั้งหมด และงานหนักอึ้งต้องอวดเพื่อน ๆ จนเหนื่อย [บล็อก](https://discord.com/blog/server-activities-games-voice-watch-together)มีเรื่องราวทั้งหมดเขียนไว้ \n* **ขอแนะนำ Nitro Basic** Nitro ขนาดจิ๋วที่สุดที่ราคาจิ๋วยิ่งกว่า ปลดล็อกอีโมจิทั้งหมดทุกที่ อัปโหลดไฟล์ได้ใหญ่ขึ้น และอื่น ๆ อีกมากมาย มีให้บริการแล้วเกือบทุกประเทศ ที่เหลือก็อีกไม่นาน\n* **ข้อเสนอเด็ดใหม่จาก Nitro: ธีมโปรไฟล์** เลือกรูปแบบสีเพื่อสร้างความโดดเด่นให้กับโปรไฟล์ของคุณ เปิดให้ใช้เร็ว ๆ นี้ในการตั้งค่าผู้ใช้สำหรับผู้ใช้ที่มี Nitro ทุกคน\n* **ฟังทางนี้ ฟังทางนี้ ช่องฟอรั่มอยู่นี่แล้ว เย้** ความคลาสสิกในแบบของเรา ปลดปล่อยตัวคุณจากข้อจำกัดของหัวข้อเดียว เพราะคุณมีเรื่องราวและความคิดมากมายอยู่ในหัว\n* **เพิ่มแอปไปยังเซิร์ฟเวอร์ของคุณได้ทันทีจาก [App Directory](https://discord.com/blog/app-directory-is-here-mods-and-admins) ใหม่** ชุมชนผู้พัฒนา Discord สร้างสิ่งที่ยอดเยี่ยมที่จะช่วยให้เซิร์ฟเวอร์ของคุณทำงานได้ตามที่คุณต้องการ เราก็เลยคิดว่า... มันน่าจะหาง่ายกว่านี้ไม่ใช่เหรอ แล้วก็นี่เลย ถ้าคุณจะจัดการเซิร์ฟเวอร์ ก็แค่ไปที่การตั้งค่าเซิร์ฟเวอร์\n* **Discord Voice บน Xbox เปิดให้ใช้งานแล้วสำหรับทุกคน** ใช่ เราพูดจริง เพื่อน ๆ จะสามารถดูเกมที่คุณกำลังเล่นอยู่บนคอนโซลได้ และตอนนี้ คุณสามารถร่วมการแชทด้วยเสียงกับเพื่อน ๆ บน Discord จาก Xbox ได้แล้ว หลังจากที่คุณขอมาหลายปี ขอบคุณที่อดทนรอ เรียนรู้เพิ่มเติมได้ที่[บล็อก](https://dis.gd/xbox-voice). \n\nการอัปเดตในการตั้งค่า {progress}\n======================\n\n* **ตอนนี้ข้อความแบบสุ่มจะถูกกรองแล้ว** ถ้าใครสักคนที่คุณไม่ได้เป็นเพื่อนด้วยส่งข้อความส่วนตัวหาคุณ คุณจะเห็นข้อความนั้นในโฟลเดอร์แยก "คำขอข้อความ" แต่ถ้าคุณไม่ได้มีปัญหากับข้อความที่คนอื่นส่งมา คุณก็สามารถ[ปิดได้](https://support.discord.com/hc/articles/7924992471191-Message-Requests)\n* **คุณสามารถจัดการไฮไลต์การแจ้งเตือนของคุณได้** ติดตามสิ่งที่เกิดขึ้นในเซิร์ฟเวอร์โปรดของคุณ หรือ[เลิกติดตาม](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications)ถ้าคุณไม่ชอบ ชอบแบบไหนคุณเลือกได้เองเลย\n* **เพิ่มความสามารถในการตรวจจับสแปมในเซิร์ฟเวอร์ชุมชน** หากมีคนพยายามสแปมการ @mentions หรือโพสต์ลิงก์หลอกลวง AutoMod สามารถบล็อกข้อความไม่ให้โพสต์ได้ แอดมินชุมชนสามารถจัดการคุณสมบัตินี้ได้ในการตั้งค่าเซิร์ฟเวอร์\n* **ดูอุปกรณ์ที่คุณเข้าสู่ระบบ** เข้าไปที่ตั้งค่าผู้ใช้ › อุปกรณ์ ซึ่งเป็นจุดที่ดีที่คุณสามารถออกจากระบบในคอมพิวเตอร์ของครอบครัวหรือโทรศัพท์เครื่องเก่าล้านปีของคุณได้\n\n\n---changelog---\ndate: "2022-11-01"\nlocale: "tr"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\nYeni Özellikler {added marginTop}\n======================\n\n* **Etkinlikler partiye katıldı.** Dilediğin ses kanalına gir ve keyifli bir akşam için anında Watch Together izleme listesi veya Putt Party oyununu ateşle (roket gibi hani, çaktın mı?). Nitro aboneliğin de varsa Etkinlik kataloğunun tamamına erişebilir ve arkadaşlarına hiç içinden gelmese de hava atabilirsin. Detaylı bilgiler [blogda](https://discord.com/blog/server-activities-games-voice-watch-together). \n* **Karşında Nitro Basic.** Nitro\'nun en küçük versiyonu, hem de daha ucuza. Bu versiyonla tüm emojileri her yerde açabilir, daha büyük dosyalar yükleyebilir ve daha fazlasını yapabilirsin. Şimdiden çoğu ülkede etkin, diğer ülkelere de yakında gelecek.\n* **Yeni Nitro avantajı: Profil Temaları.** Profilini şenlendirmesi için bir renk şeması seç. Yakında Nitro abonesi herkesin Kullanıcı Ayarları\'na geliyor.\n* **Duyduk duymadık demeyin, Forum Kanalları geliyor.** Herkesin bildiği bu özelliği bir de bizde dene. Kendini tek bir konunun zincirlerinden kurtar çünkü sen birçok fikir barındıran komplike bir bireysin.\n* **Yeni [App Directory](https://discord.com/blog/app-directory-is-here-mods-and-admins) ile sunucuna kolayca uygulamalar ekle.** Discord Geliştirici topluluğu, sunucunun tam da istediğin gibi olması için süper şeyler üretiyor. Biz de bu şeyleri bulmanı kolaylaştıralım dedik. Sunucun varsa Sunucu Ayarları\'na giderek bu özelliği inceleyebilirsin.\n* **Xbox\'taki Discord Sesli Sohbet\'i artık herkes kullanabiliyor.** EVET, GAYET CİDDİYİM. Arkadaşlarının konsollarında hangi oyunu oynadığını görebilecek ve ARTIK YILLARDIR İSTEDİĞİN GİBİ XBOX ÜZERİNDEN ARKADAŞLARINLA DISCORD SESLİ SOHBET\'TE KONUŞABİLECEKSİNİZ. SABRIN İÇİN TEŞEKKÜRLER. Daha fazla bilgi [blogda](https://dis.gd/xbox-voice). \n\nAyarlar Güncellemeleri {progress}\n======================\n\n* **Rastgele mesajlar artık filtreleniyor.** Arkadaş olmadığın biri sana direkt mesaj gönderdiğinde dilersen bu mesaj ayrı bir Mesaj İstekleri klasörüne geliyor. Bunun olmasını istemezsen bu ayarı [kapatabilirsin](https://support.discord.com/hc/articles/7924992471191-Message-Requests).\n* **Öne Çıkarma bildirimlerini artık yönetebiliyorsun.** En sevdiğin sunucularda olup biteni takipte kal veya [kalma](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications). Sana kalmış, karar senin.\n* **Topluluk sunucularındaki spam tespitini geliştirdik.** Biri @bahsetmeleri spam\'ler veya sahtecilik amaçlı bir bağlantı gönderirse artık AutoMod bu mesajın gönderilmesini engelleyebiliyor. Topluluk yöneticileri bu özelliği Sunucu Ayarları\'nda inceleyebilir.\n* **Oturum açtığın cihazları artık görebilirsin.** Kullanıcı Ayarları > Cihazlar sekmesine bir göz at çünkü burası aile bilgisayarındaki veya tarih öncesinden kalma telefonundaki oturumunu kapatabileceğin büyülü bir yer.\n\n\n---changelog---\ndate: "2022-11-01"\nlocale: "ua-ua"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\nНові можливості {added marginTop}\n======================\n\n* **На нашому святі життя з\'явились активності!** Зазирнувши в будь-який голосовий канал, ви зможете миттєво запустити (як ракету) плейлист «Watch Together» або гру «Putt Party» та добре провести час. До речі, чи є у вас Nitro? Якщо да, то вам буде доступний повний каталог активностей та ви зможете хвалитися вашим друзям. Всі подробиці у нашому [блозі](https://discord.com/blog/server-activities-games-voice-watch-together). \n* **Зустрічайте Nitro Basic!** Найскромніший варіант передплати Nitro за ще більш скромною ціною. Ви зможете використовувати всі емодзі де завгодно та завантажувати файли більшого розміру, а також отримаєте ряд інших переваг. Цей тариф вже доступний в багатьох країнах, та скоро їх стане ще більше.\n* **Нова перевага Nitro: теми профілю.** Прикрасьте свій профіль, обравши для нього кольорову палітру! Теми скоро з\'явяться в розділі «Користувацькі налаштування» у всіх передплатників Nitro.\n* **Увага, увага, для вас ще одна перевага! ** В Discord з\'явились канали форумів — наш варіант класичних платформ для спілкування. Ви більше не вимушені обговорювати одну єдину тему для спілкування, адже у вашій голові стільки різноманітних думок та ідей!\n* **Додавайте програми на свій сервер з допомогою нового [каталогу програм (App Directory)](https://discord.com/blog/app-directory-is-here-mods-and-admins).** Спільнота розробників Discord створює круті штуки, щоб вам було простіше керувати сервером. І ми подумали...чому б не полегшити їх пошук? Та полегшили! Якщо ви маєте права на керування сервером, відкрийте його налаштування та зазирніть у каталог.\n* **Голосові канали Discord на Xbox стали доступними всім користувачам.** НІ, ЦЕ ВАМ НЕ ЖАРТИ. Тепер ваші друзі будуть бачити, яку гру ви запустили на своїй консолі, а ВИ ЗМОЖЕТЕ СПІЛКУВАТИСЯ З НИМИ В ГОЛОСОВОМУ ЧАТІ DISCORD НА XBOX, ТОМУ ЩО ДОВГО ЧЕКАЛИ НА ЦЮ ФУНКЦІЮ. Дякуємо вам за терпіння! Докладніше читайте в [блозі](https://dis.gd/xbox-voice). \n\nОновлення налаштувань {progress}\n======================\n\n* **Увімкнена фільтрація випадкових повідомлень.** Якщо хтось, хто не є вашим другом, відправить вам приватне повідомлення, воно з\'явиться в окремій папці «Запити спілкування». Якщо ви не проти отримувати повідомлення від незнайомих людей, спокійно [вимикайте](https://support.discord.com/hc/articles/7924992471191-Message-Requests) цю функцію.\n* **Тепер ви можете керувати сповіщеннями про важливі події.** Слідкуйте за тим, що відбувається на ваших улюблених серверах, або [ігноруйте](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications) їх, якщо вам таке не подобається. Обирайте те, що хочете.\n* **Посилена система виявлення спама на серверах спільнот.** Якщо хтось спробує спамити @спогадуваннями чи посиланнями на шахрайські сайти, AutoMod заблокує публікацію таких повідомлень. Адміністратори спільнот можуть керувати цією функцією в налаштуваннях сервера.\n* **Дізнайтеся, на яких пристроях ви виконали вхід.** Для цього перейдіть в розділ «Користувацькі налаштування» > «Пристрої». В цьому чудовому місці ви зможете вийти зі свого акаунта на сімейному комп\'ютері чи стародавньому смартфоні.\n\n\n---changelog---\ndate: "2022-11-01"\nlocale: "vi-vn"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\nTính Năng Mới {added marginTop}\n======================\n\n* **Hoạt Động đã được ra mắt.** Hãy vào một kênh thoại bất kỳ và mở ngay Watch Together ngay hoặc cùng chơi Putt Party nào! Bạn sở hữu Nitro sao? Bạn sẽ nhận được toàn bộ danh sách các Hoạt Động và đây sẽ là cơ hội tuyệt vời để thể hiện với nhóm bạn của mình. Hãy tới [blog](https://discord.com/blog/server-activities-games-voice-watch-together) của chúng tôi để biết thêm thông tin chi tiết. \n* **Giới thiệu Nitro Cơ Bản.** Phiên bản Nitro rút gọn của chúng tôi, với giá mềm hơn. Mở khóa toàn bộ emoji ở mọi nơi, tải lên tệp tin lớn hơn và nhiều tính năng khác. Hiện đã có mặt tại hầu hết quốc gia và sẽ tiếp tục mở rộng.\n* **Đặc quyền Nitro mới: Chủ Đề Hồ Sơ.** Chọn một dải màu để làm nổi bật hồ sơ của bạn. Sắp xuất hiện trong Thiết Lập Người Dùng cho tất cả những thành viên sở hữu Nitro.\n* **Nghe rồi, nghe rồi, có Kênh Diễn Đàn rồi đây…được chưa nào.** Một tính năng cổ điển. Giải phóng bản thân khỏi sự ràng buộc của duy nhất 1 chủ đề, vì trí tuệ của bạn là không có giới hạn.\n* **Thêm ứng dụng vào máy chủ của bạn ngay từ [App Directory](https://discord.com/blog/app-directory-is-here-mods-and-admins).** Cộng đồng những Nhà Phát Triển Discord tạo ra những tính năng tuyệt vời hỗ trợ bạn quản lý máy chủ. Và theo chúng tôi thì…chúng dễ tìm chút thì tốt hơn nhỉ? Nghĩ sao thì làm vậy. Nếu bạn đang quản lý một máy chủ, hãy tới Cài đặt máy chủ để thử tính năng này nhé.\n* **Thoại Discord trên Xbox đã ra mắt cho tất cả mọi người.** PHẢI, TÔI NGHIÊM TÚC ĐÓ. Bạn bè sẽ có thể thấy game mà bạn đang chơi trên máy cầm tay của mình và BẠN GIỜ CÓ THỂ THOẠI DISCORD TỪ XBOX NHƯ MONG MUỐN TỪ BẤY LÂU NAY. CÁM ƠN BẠN ĐÃ KIÊN NHẪN CHỜ ĐỢI NHA. Tìm hiểu thêm tại [blog của chúng tôi](https://dis.gd/xbox-voice). \n\nCập Nhật Cài Đặt {progress}\n======================\n\n* **Các tin nhắn ngẫu nhiên giờ sẽ được lọc.** Nếu một người không phải bạn bè gửi DM cho bạn, bạn sẽ có thể thấy chúng trong một thư mục Yêu cầu tin nhắn riêng. Nếu bạn không ngại nhận tin nhắn từ bất kỳ ai, bạn có thể [tắt tính năng này](https://support.discord.com/hc/articles/7924992471191-Message-Requests).\n* **Bạn giờ có thể quản lý thông báo Tin nổi bật của mình.** Liên tục cập nhật những gì đang diễn ra trong máy chủ ưa thích của bạn—hoặc [tắt đi](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications), nếu bạn không thích. Tùy ở bạn.\n* **Tăng cường phát hiện spam trong các Máy Chủ Cộng Đồng.** Nếu ai đó đang cố spam @mentions hoặc đăng một đường dẫn lừa đảo, AutoMod có thể chặn tin nhắn này trước khi nó được đăng lên. Các quản trị viên có thể quản lý tính năng này trong Cài đặt máy chủ.\n* **Xem các thiết bị mà bạn đã đăng nhập.** Hãy tới Thiết Lập Người Dùng › Thiết Bị, đây là nơi tuyệt vời để bạn có thể đăng xuất khỏi máy tính gia đình hoặc những điện thoại cũ không còn sử dụng.\n\n\n---changelog---\ndate: "2022-11-01"\nlocale: "zh-CN"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\n新功能 {added marginTop}\n======================\n\n* **小活动加入了派对。**进入任何一个语音频道，立即开启“Watch Together”播放列表或“Putt Party”游戏，享受一场惬意的小聚。订阅了 Nitro？你将享受完整的小活动列表，在一众好友间秀出特权。更多详情，请前往[博客](https://discord.com/blog/server-activities-games-voice-watch-together)。 \n* **来介绍一下 Nitro Basic。**这是我们最小巧的 Nitro，价格也同样小巧。解锁所有表情符号，上传更大的文件，以及更多特权。大多数国家已支持订阅，很即将拓展到更多国家。\n* **全新 Nitro 特权：个人资料主题。**选择一款配色方案，装扮您的个人资料。即将在用户设置中向所有订阅 Nitro 的用户提供。\n* **听到了，听到了，论坛频道在这里。**我们对经典的再诠释。把自己从单一话题的枷锁中解放出来，因为你有无穷的想法。\n* **从全新 [App Directory](https://discord.com/blog/app-directory-is-here-mods-and-admins) 中向您的服务器添加应用程序。**Discord 开发者社区创造的东西简直棒极了，它们让您的服务器为您工作。我们就想……如果能更容易地找到它们，岂不更妙？于是有了这款产品。如果您是服务器管理员，不妨前往服务器设置看看。\n* **Xbox 上的 Discord 语音现已向所有人开放。**我可是认真的。您的好友可以看到您正在主机上玩什么游戏，您也可以通过 Xbox 直接加入好友的 Discord 语音聊天，大家多年来的诉求即将实现。感谢您的耐心等待。前往[博客](https://dis.gd/xbox-voice)了解更多。 \n\n设置更新 {progress}\n======================\n\n* **随机消息现在将被过滤。**如果并非您好友的人给您发了一条私信，您将会在独立的消息请求文件夹中看到它。如果您不介意陌生人的消息，也可将其[关闭](https://support.discord.com/hc/articles/7924992471191-Message-Requests)。\n* **您可以管理您的集锦通知。**了解您最爱的服务器上正在发生什么事。如果不喜欢，您也可以将其[关闭](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications)。按照喜好随意调整。\n* **加强社区服务器中的垃圾信息检测。**如果有人试图发送垃圾@被提及信息或发布欺诈链接，AutoMod 可以阻止该消息发布。社区管理员可以在服务器设置中进行管理。\n* **查看您登录的设备。**前往“用户设置 › 设备”中查看，在这里您可以注销家用电脑或老旧手机上的登录。\n\n\n---changelog---\ndate: "2022-11-01"\nlocale: "zh-TW"\nrevision: 1\nyoutube_video_id: "8jD0dkCgF7k"\n---\n新功能 {added marginTop}\n======================\n\n* **「活動」已登場。**進入任何語音頻道，立即開始 (因為發射火箭與開始在英文中是同個詞，你懂的) 一場《Watch Together》或《Putt Party》遊戲悠閒消磨時間。您有訂閱 Nitro 嗎？訂閱即可獲得完整的「活動」目錄，還能向好友大肆炫耀。一切資訊盡在 [部落格](https://discord.com/blog/server-activities-games-voice-watch-together)。 \n* **向您介紹 Nitro Basic。**最簡易版本的 Nitro 訂閱，價格也更低廉。可隨時隨地解鎖所有表情符號、上傳更大檔案和其他功能。目前已於大多數國家推出，很快便會繼續拓展。\n* **新的 Nitro 訂閱福利：個人資料主題。** 選擇一種色彩配置來突顯您的個人資料。此功能即將於使用者設定中推出，供 Nitro 訂閱者使用。\n* **各位請注意，論壇頻道在此登場...耶。**我們對經典的重新詮釋。將您從單一主題中解放出來，沉浸在眾多想法之中。\n* **直接從新的 [App Directory](https://discord.com/blog/app-directory-is-here-mods-and-admins) 將應用程式新增至伺服器。**Discord 開發人員社群製作了超棒功能，能讓伺服器依您所好運作。然後我們就在想...應該讓大家更容易找到這些功能。現在終於如願以償。如果您管理伺服器，就前往伺服器設定看看吧。\n* **Xbox 上的 Discord 語音現在可供所有人使用。**對，我沒在開玩笑。好友們可看到您正在遊戲主機上玩的遊戲，您可以一償所願，在 Xbox 的 Discord 語音裡與他們交談。感謝您的耐心等候。可於 [部落格](https://dis.gd/xbox-voice) 進一步了解。 \n\n設定更新 {progress}\n======================\n\n* **現已過濾掉隨機訊息。**若有非好友傳送私訊給您，您將可於單獨的訊息請求資料夾中查看此訊息。若您不介意收到任何人的訊息，您可以 [將此功能關閉](https://support.discord.com/hc/articles/7924992471191-Message-Requests)。\n* **您可以管理重點資訊通知。**隨時掌握您最愛的伺服器中發生的大小事；如果您不喜歡此功能，[別關注即可](https://support.discord.com/hc/articles/5304469213079-Highlights-Notifications)，您開心就好。\n* **強化社群伺服器中的濫發訊息偵測。**若有人試圖濫用 @mentions 或張貼詐騙連結，AutoMod 可在此訊息發布前將其封鎖。社群管理員可於伺服器設定中管理此功能。\n* **檢視您已登入的裝置。**查看使用者設定 › 裝置，好處就是可從此處登出您的家庭電腦或萬年老手機。\n\n\n'
